	$translations['M00021']['Filipino'] = "Walang sinuman ang may pahintulot o kakayahang ma-access ang iyong Wallet, kabilang ang koponan ng TheNux mismo. Ikaw lamang ang makaka-access ng iyong Wallet sa pamamagitan lamang ng paggamit ng iyong cellphone";

	$translations['M00022']['english'] = "Nobody has the authorization or capability to access your wallet, including the TheNux team ourselves. Only you can access your wallet by simply using your cellphone.";
	$translations['M00022']['chineseSimplified'] = "任何人都没有授权或能力来打开您的钱包，包括TheNux。只有您可以使用您的手机打开您的钱包。";
	$translations['M00022']['chineseTraditional'] = "任何人都沒有授權或能力來打開您的錢包，包括TheNux。只有您可以使用您的手機打開您的錢包。";
	$translations['M00022']['Malay'] = "Tiada sesiapa yang mempunyai hak atau keupayaan untuk mengakses dompet anda, termasuk pihak TheNux. Hanya anda boleh mengakses dompet anda dengan menggunakan telefon bimbit anda.";
	$translations['M00022']['Indonesia'] = "Tidak ada sesiapa yang memiliki hak atau kemampuan untuk mengakses dompet anda, termasuk TheNux. Hanya anda yang dapat mengakses dompet anda menggunakan ponsel Anda.";
