	$translations['M00023']['Korean'] = "지갑 키는 당신의 휴대폰안에 있으므로 아무도 당신의 키를 만질수 없습니다";
	$translations['M00023']['Spanish'] = "Su clave de billetera se almacena en su teléfono celular. Por lo tanto, nadie tiene la capacidad de hacer una copia de su clave de billetera única, además de usted.";
	$translations['M00023']['Portuguese'] = "A chave da sua carteira é armazenada dentro do seu celular. Logo, ninguém tem a capacidade de fazer uma cópia da chave única da sua carteira além de você.";
	$translations['M00023']['Thai'] = "คีย์ Wallet ของคุณถูกเก็บไว้ในโทรศัพท์มือถือของคุณ ดังนั้นไม่มีใครสามารถคัดลอกคีย์ Wallet ของคุณได้นอกจากตัวคุณเอง";
	$translations['M00023']['Filipino'] = "Ang susi ng iyong Wallet ay naka-imbak sa loob ng iyong cell phone. Samakatuwid, walang sinuman ang may kakayahang gumawa ng isang kopya ng iyong natatanging susi ng Wallet bukod sa iyong sarili.";

	$translations['M00024']['english'] = "Your wallet key is stored within your cell phone. Therefore, nobody has the capability to make a copy OF your unique wallet key besides yourself. ";
	$translations['M00024']['chineseSimplified'] = "您的钱包钥匙存储在您的手机中。因此，除了您以外没有人能够得到您的钱包钥匙。";
	$translations['M00024']['chineseTraditional'] = "您的錢包鑰匙存儲在您的手機中。因此，除了您以外沒有人能夠得到您的錢包鑰匙。";
	$translations['M00024']['Malay'] = "Kunci dompet anda disimpan dalam telefon bimbit anda. Oleh itu, tiada siapa yang mempunyai keupayaan untuk membuat salinan kunci unik dompet  anda selain diri anda.";
	$translations['M00024']['Indonesia'] = "Kunci dompet anda disimpan di ponsel anda. Karena itu, tidak ada yang memiliki kemampuan untuk membuat salinan unik dompet anda selain diri anda sendiri.";
