	$translations['M00025']['Japanese'] = "携帯電話番号を使用して、ウォレットが保護されていることを確認してください。 TheNuxウォレットにアクセスするには、番号とウォレットキーの両方が必要です。";
	$translations['M00025']['Korean'] = "저희는 당신이 휴대전화 번호를 사용하는 것을 추천합니다. TheNux 지갑을 사용할때는 전화번호와 지갑 키가 필요합니다";
	$translations['M00025']['Spanish'] = "Le pedimos que use su número de teléfono celular para asegurarse de que su billetera esté protegida. Para acceder a su billetera TheNux, se requerirá su número y clave de billetera.";
	$translations['M00025']['Portuguese'] = "Nós pedimos que você use o número do seu celular para assegurar que a sua carteira esteja protegida. Para acessar a sua carteira TheNux, o seu número e a chave da sua carteira serão requisitados.";
	$translations['M00025']['Thai'] = "เราขอให้คุณใช้เบอร์โทรศัพท์เพื่อให้มั่นใจว่า Wallet ของคุณได้รับการปกป้อง เพื่อเข้าถึง TheNux Wallet ของคุณ จำเป็นต้องใช้เบอร์โทรศัพท์ และคีย์ของคุ$";
	$translations['M00025']['Filipino'] = "Hinihiling namin sa iyo na gamitin ang iyong numero ng cellphone upang matiyak na protektado ang iyong Wallet. Upang ma-access ang iyong TheNux na Wallet, ang iyong numero at susi ng Wallet ay parehong kinakailangan.";

	$translations['M00026']['english'] = "We ask you to use your cellphone number to ensure that your wallet is protected. In order to access your TheNux wallet, your number and wallet key will both be required. ";
	$translations['M00026']['chineseSimplified'] = "我们使用您的手机号码来保护以及绑定您的钱包。您必须同时拥有电话号码和钱包钥匙才能打开钱包。";
	$translations['M00026']['chineseTraditional'] = "我們使用您的手機號碼來保護以及綁定您的錢包。您必須同時擁有電話號碼和錢包鑰匙才能打開錢包。";
	$translations['M00026']['Malay'] = "Kami meminta anda untuk menggunakan nombor telefon anda untuk memastikan bahawa dompet anda dilindungi. Untuk mengakses wallet TheNux anda, kekunci nombor dan dompet anda kedua-duanya akan diperlukan.";
	$translations['M00026']['Indonesia'] = "Kami meminta anda menggunakan nomor telepon anda untuk memastikan dompet anda terlindungi. Untuk mengakses dompet TheNux anda, nomor dan kunci dompet anda akan diperlukan.";
