	$translations['M00027']['Japanese'] = "他のデジタルウォレットとは異なり、12フレーズのバックアップシステムは使用しません。 TheNuxバックアップシステムにはウォレットキーと携帯電話番号の両方が必要であるため、誰かがウォレットキーを盗んだとしても、携帯電話にアクセスしなければウォレットにアクセスできません。";
	$translations['M00027']['Korean'] = "저희는 다른 디지털 지갑과 달리 12프레이즈 백업을 사용을 하지 않습니다. TheNux 지갑은 휴대전화 번호와 지갑 키를 사용하기 때문에 누군가 당신의 지갑 키를 훔쳐간다고 해도 휴대폰 없이 지갑을 사용을 못합니다.";
	$translations['M00027']['Spanish'] = "A diferencia de otras billeteras digitales, no utilizamos un sistema de copia de seguridad de 12 frases. Dado que el sistema de copia de seguridad de TheNux requiere su clave de billetera y su número de teléfono celular, si alguien robara su clave de billetera, tampoco podría acceder a su billetera sin tener acceso a su teléfono.";
	$translations['M00027']['Portuguese'] = "Diferente de outras carteiras digitais, nós não usamos um sistema de backup de 12 frases. Como o sistema de backup do TheNux requer a chave da sua carteira e o número do seu celular, se alguém quiser roubar a chave da sua carteira, ele ainda não poderia ser capaz de acessar a sua carteira sem ter acesso ao seu telefone também.";
	$translations['M00027']['Thai'] = "ไม่เหมือนกับ Wallet ดิจิทัลอื่น ๆ เราไม่ใช้ระบบสำรองข้อมูล 12 เฟส เพราะระบบสำรองข้อมูลของ TheNux จำเป็นต้องใช้ทั้งคีย์ และเบอร์โทรศัพท์ของคุณ หากมีใครสามารถขโมยคีย์ Wallet ของคุณได้ แต่พวกเขาก็จะยังไม่สามารถเข้าถึง Wallet ของคุณได้ตราบใดที่เขายังไม่สามารถเข้าถึงโทรศัพท์ของคุณได้เช่นกัน";
	$translations['M00027']['Filipino'] = "Hindi tulad ng iba pang mga digital na wallet, hindi kami gumagamit ng isang 12-pariralang backup na sistema. Dahil ang backup na sistema ng TheNux ay nangangailangan ng susi ng iyong wallet at numero ng cellphone, kung nakawin man ng isang tao ang susi ng iyong wallet, hindi pa rin nila maa-access ang iyong wallet nang walang pag-access sa iyong telepono.";

	$translations['M00028']['english'] = "Unlike other digital wallets, we do not use a 12-phrase backup system. Since TheNux backup system requires both your wallet key and cellphone number, if somebody was to steal your wallet key, they would still not be able to access your wallet without having access to your phone as well. ";
	$translations['M00028']['chineseSimplified'] = "不像其他的数字钱包，我们不使用12短语备份系统。由于TheNux备份系统同时需要您的钱包钥匙和手机号码，如果有人偷了您的钱包钥匙，他们仍然无法打开您的钱包。";
	$translations['M00028']['chineseTraditional'] = "不像其他的數字錢包，我們不使用12短語備份系統。由於TheNux備份系統同時需要您的錢包鑰匙和手機號碼，如果有人偷了您的錢包鑰匙，他們仍然無法打開您的錢包。";
	$translations['M00028']['Malay'] = "Tidak seperti dompet digital yang lain, kami tidak menggunakan sistem sandaran frasa-12. Sistem  sandaran TheNux memerlukan kedua-dua kunci dompet dan nombor telefon bimbit anda, jika seseorang ingin mencuri kunci dompet anda, mereka masih tidak boleh mengakses dompet anda tanpa mempunyai akses kepada telefon anda juga.";
	$translations['M00028']['Indonesia'] = "Tidak seperti dompet digital lainnya, kami tidak menggunakan sistem cadangan frasa-12. Sistem sandaran The Nux membutuhkan dompet dan kunci telepon anda, jika seseorang ingin mencuri kunci dompet anda, mereka masih tidak dapat mengakses dompet anda tanpa memiliki akses ke telepon anda juga.";
