	$translations['M00029']['Japanese'] = "TheNuxに関連する技術的な問題に直面している場合は、いつでもお問い合わせください。フレンドリーなサポートチームがすぐにご連絡いたします。";
	$translations['M00029']['Korean'] = "TheNux에 관련해서 문제가 생긴다면 언제나 연락을 해주세요. 저희 서포트 팀이 빠르게 해결하겠습니다.";
	$translations['M00029']['Spanish'] = "Si tiene problemas técnicos relacionados con TheNux, puede contactarnos en cualquier momento. Nuestro amable equipo de soporte se pondrá en contacto con usted a la brevedad.";
	$translations['M00029']['Portuguese'] = "Se você estiver enfrentando qualquer problema técnico relacionado ao TheNux, você pode entrar em contato conosco a qualquer hora. A nossa equipe de suporte amigável fará contato com você prontamente.";
	$translations['M00029']['Thai'] = "ถ้าหากคุณพบปัญหาทางเทคนิคใด ๆ ที่เกี่ยวข้องกับ TheNux คุณสามารถติดต่อเราได้ตลอดเวลา ทีมงานที่เป็นมิตรของเราจะรีบติดต่อคุณทันที";
	$translations['M00029']['Filipino'] = "Kung nahaharap ka sa anumang mga teknikal na isyu na may kaugnayan sa TheNux, maaari kang makipag-ugnay sa amin sa anumang oras. Agad na makikipag-ugnay sa iyo ang aming mabait na grupo ng suporta.";

	$translations['M00030']['english'] = "If you are facing any technical issues related to TheNux, you can contact us at any time. Our friendly support team will get in touch with you promptly.";
	$translations['M00030']['chineseSimplified'] = "如果您正面临着与TheNux任何技术问题，您可以随时与我们联系。我们友好的支持团队会尽快与您联系。";
	$translations['M00030']['chineseTraditional'] = "如果您正面臨著與TheNux任何技術問題，您可以隨時與我們聯繫。我們友好的支持團隊會盡快與您聯繫。";
	$translations['M00030']['Malay'] = "Jika anda menghadapi sebarang isu teknikal yang berkaitan dengan TheNux, anda boleh menghubungi kami pada bila-bila masa. Pasukan perkhidmatan pelanggan kami yang mesra akan menghubungi anda dengan segera.";
	$translations['M00030']['Indonesia'] = "Jika anda menemukan masalah teknis yang terkait dengan TheNux, anda bleh menghubungi kami kapan saja. Tim layanan pelanggan kami yang ramah akan segera menghubungi anda.";
