	$translations['M00113']['Japanese'] = "Payment Gatewayは、お客様のビジネスがリスク、変動、詐欺、チャージバックなしで支払いを受けることを保証するために機能します。当社の製品を使用することにより、ビットコインまたはイーサリアムのどちらで収益を決済するかを選択できます。";
	$translations['M00113']['Korean'] = "저희 비용 지불 게이트웨이는 비용을 위험성 없이 받을수 있는 것을 보장합니다";
	$translations['M00113']['Spanish'] = "Nuestra compuerta de pago trabaja para garantizar que su empresa reciba sus pagos sin ningún riesgo, volatilidad, fraude o devolución de cargo. Al utilizar nuestro producto, puede optar por liquidar sus ingresos en Bitcoin o Ethereum.";
	$translations['M00113']['Portuguese'] = "O nosso Portal de Pagamento funciona para garantir que a sua empresa receba seus pagamentos sem qualquer risco, volatilidade, fraude ou estorno. Ao usar o nosso produto, você pode escolher definir a sua receita ou em Bitcoin ou em Ethereum.";
	$translations['M00113']['Thai'] = "ช่องทางการชำระเงินของเรารับรองได้ว่าธุรกิจของคุณจะได้รับการชำระเงินโดยที่ไม่มีความเสี่ยงใด ๆ ความผันผวน การทุจริต หรือการปฏิเสธการชำระเงิน";
	$translations['M00113']['Filipino'] = "Ang aming Gateway ng Pagbabayad ay tinitiyak na natatanggap ng iyong negosyo ang mga bayad nang walang anumang peligro, pagbabago-bago, pandaraya o chargeback. Sa pamamagitan ng paggamit ng aming produkto, maaari mong piliing manatili ang iyong kita sa alinman sa Bitcoin o Ethereum.";

