	$translations['M00129']['english'] = "After you login, click on the “Payment Gateway” option to then setup your Payment Gateway address destination. After doing this, you can start receiving cryptocurrency payments by using your Payment Gateway address from the address listing.";
	$translations['M00129']['chineseSimplified'] = "登入后，单击“支付网关”选项，然后设置支付网关地址目的地。 执行此操作后，您可以使用地址列表中的付款网关地址开始接收加密货币付款。";
	$translations['M00129']['chineseTraditional'] = "登入後，單擊“支付網關”選項，然後設置支付網關地址目的地。 執行此操作後，您可以使用地址列表中的付款網關地址開始接收加密貨幣付款。";
	$translations['M00129']['Malay'] = "Selepas anda log masuk, klik pada pilihan \"Gerbang pembayaran \" untuk setup alamat destinasi gerbang pembayaran anda . Selepas melakukan ini, anda boleh mula menerima bayaran cryptocurrency dengan menggunakan alamat gerbang pembayaran anda daripada senarai alamat.";
	$translations['M00129']['Indonesia'] = "Selepas log masuk, klik opsi \"Gerbang Pembayaran\" untuk mengatur alamat tujuan gerbang pembayaran anda. Setelah melakukan ini, anda boleh mulai menerima pembayaran cryptocurrency dengan menggunakan alamat gerbang pembayaran anda dari senarai alamat.";
	$translations['M00129']['Japanese'] = "ログイン後、「Payment Gateway」オプションをクリックして、Payment Gatewayのアドレス宛先を設定します。 これを行った後、アドレス一覧からPayment Gatewayアドレスを使用して仮想通貨の支払いの受け取りを開始できます。";
	$translations['M00129']['Korean'] = "로그인 뒤 지불 게이트웨이를 눌러서 크립토커런시를 지불 받는 주소를 정하세요. 그 다음에는 크립토커런시 비용 지불 방법을 사용해서 크립토커런시를 받을수 있습니다";
	$translations['M00129']['Spanish'] = "Después de iniciar sesión, haga clic en la opción \"Compuera de pago\" para luego configurar el destino de la dirección de la compuerta de pago. Después de hacer esto, puede comenzar a recibir pagos de criptomonedas utilizando su dirección de compuerta de pago de la lista de direcciones.";
	$translations['M00129']['Portuguese'] = "Depois de iniciar a sessão, clique na opção “Portal de Pagamento” para então configurar o endereço de destino do seu Portal de Pagamento. Depois de fazer isso, você pode começar a receber pagamentos em criptomoedas usando o endereço do seu Portal de Pagamento da lista de endereços.";
	$translations['M00129']['Thai'] = "หลังจากลงชื่อเข้าใช้ คลิกที่ตัวเลือก “ช่องทางการชำระเงิน” เพื่อตั้งค่าแอดเดรสช่องทางการชำระเงิน หลังจากนั้นคุณสามารถเริ่มรับเงินคริปโตโดยใช้ที่อยู่ช่องทางการชำระเงินจากลิสต์รายการแอดเดรส";
	$translations['M00129']['Filipino'] = "Matapos mong mag-login, i-click ang pagpipilian na \"Gateway ng Pagbabayad\" upang i-setup ang patutunguhang address ng iyong Gateway ng Pagbabayad. Matapos gawin ito, maaari ka nang magsimulang tumanggap ng mga bayad na cryptocurrency sa pamamagitan ng paggamit ng iyong address ng Gateway ng Pagbabayad mula sa listahan ng address.";

