	$translations['M00263']['english'] = "After you login, select \"Live Chat” and then click \"Live Chat Setup\". Copy the script into the html of your website, and the chat widget will start working instantly.";
	$translations['M00263']['chineseSimplified'] = "您登录后，选择“在线聊天”，然后点击‘实时聊天设置’，将脚本复制到您的网站的HTML，然后实时聊天小部件会马上出现在您的网页内的右下角。";
	$translations['M00263']['chineseTraditional'] = "您登錄後，選擇“在線聊天”，然後點擊‘實時聊天設置’，將腳本複製到您的網站的HTML，然後實時聊天小部件會馬上出現在您的網頁內的右下角。";
	$translations['M00263']['Malay'] = "Selepas anda log masuk, pilih \"Sembang Langsung\" dan kemudian klik \"Sediakan Sembang Langsung\". Salin skrip ke dalam html laman web anda, dan perbualan widget akan mula beroperasi dengan serta-merta.";
	$translations['M00263']['Indonesia'] = "Selepas anda log masuk, pilih \"Obrolan Langsung\" dan kemudian klik \"Setel Obrolan Langsung.\" Salin skrip ke html situs web anda, dan pengobrolan widget akan segera mulai beroperasi.";
	$translations['M00263']['Japanese'] = "ログイン後、「ライブチャット」を選択し、「ライブチャットの設定」をクリックしますスクリプトをウェブサイトのhtmlにコピーすると、チャットウィジェットがすぐに動作を開始します。";
	$translations['M00263']['Korean'] = "로그인 한뒤 실시간 채팅에서 셋업을 눌르고. 스크립을 웹사이트에 있는 html에 넣으시면 위짓이 작동할것입니다.";
	$translations['M00263']['Spanish'] = "Después de iniciar sesión, seleccione \"Chat en vivo\" y luego haga clic en \"Configuración de chat en vivo\". Copie el script en el html de su sitio web y el widget de chat comenzará a funcionar instantáneamente.";
	$translations['M00263']['Portuguese'] = "Depois de iniciar uma sessão, selecione \"Chat Ao Vivo” e depois clique em \"Configuração do Chat Ao Vivo \". Copie o script no html do seu website, e o widget de chat irá começar a funcionar instantaneamente.";
	$translations['M00263']['Thai'] = "หลังจากที่คุณลงชื่อเข้าใช้ เลือก \"Live Chat” จากนั้นคลิกที่ \"ตั้งค่า Live Chat\" คัดลอกสคริปท์เข้าไปยัง html ของเว็บไซต์คุณ และวิทเจ็ทการสนทนาจะเริ่มทำงานทันที";
	$translations['M00263']['Filipino'] = "Pagkatapos mong mag-login, piliin ang \"Live na Chat\" at pagkatapos ay i-click ang \"I-setup ang Live na Chat\". Kopyahin ang script sa html ng iyong website, at ang chat widget ay magsisimulang gumana kaagad.";

