	$translations['M00480']['english'] = "Connect your application with TheNux. Discover how easy it is to integrate TheNux API with your website, app, software or CRM application. We support all programming languages including PHP, .NET, C#, Java, Python, Ruby etc.";
	$translations['M00480']['chineseSimplified'] = "连接TheNux与您的应用程序是件非常简单的事。我们支持所有的编程语言包括PHP，.NET，C＃，Java的，Python和Ruby等。";
	$translations['M00480']['chineseTraditional'] = "連接TheNux與您的應用程序是件非常簡單的事。我們支持所有的編程語言包括PHP，.NET，C＃，Java的，Python和Ruby等。";
	$translations['M00480']['Malay'] = "Hubungkan aplikasi anda dengan TheNux. Mengetahui bagaimana mudahnya untuk mengintegrasikan API TheNux  dengan laman web anda, aplikasi, perisian atau aplikasi CRM. Kami menyokong semua bahasa pengaturcaraan termasuk PHP, .NET, C #, Java, Python, Ruby dan lain-lain";
	$translations['M00480']['Indonesia'] = "Hubungkan aplikasi anda dengan TheNux. Temukan betapa mudahnya mengintegrasikan TheNux API dengan situs web, aplikasi, perangkat lunak, atau aplikasi CRM anda. Kami mendukung semua bahasa pemrograman termasuk PHP, .NET, C #, Java, Python, Ruby dll.";
	$translations['M00480']['Japanese'] = "アプリケーションをTheNuxに接続します。 TheNux APIをウェブサイト、アプリ、ソフトウェア、またはCRMアプリケーションと簡単に統合する方法をご覧ください。 PHP、.NET、C＃、Java、Python、Rubyなどのすべてのプログラミング言語をサポートしています。";
	$translations['M00480']['Korean'] = "TheNux 앱으로 연결하세요. TheNux를 얼마나 쉽게 당신의 웹사이트, 앱, 소프트웨어에 연결할수 있는지 알아보세요. 저희는 많은 프로그래밍 언어를 보조합니다(PHP, NET, C#, Java, Python, Ruby, 등)";
	$translations['M00480']['Spanish'] = "Conecte su aplicación con TheNux. Descubra lo fácil que es para integrar TheNux API con su sitio web, aplicación, software o aplicación CRM. Admitimos todos los lenguajes de programación, incluidos PHP, .NET, C #, Java, Python, Ruby, etc.";
	$translations['M00480']['Portuguese'] = "Conecte o seu aplicativo ao TheNux. Descubra como é fácil integrar a API TheNux ao seu website, app, software ou aplicativo CRM. Nós temos suporte a todas as linguagens de programação, incluindo PHP, .NET, C#, Java, Python, Ruby etc.";
	$translations['M00480']['Thai'] = "เชื่อมต่อแอปพลิเคชันของคุณกับ TheNux ลองดูว่ามันง่ายขนาดไหนในการเชื่อมต่อ API ของ TheNux กับเว็บไซต์ แอป ซอฟต์แวร์ หรือซีอาร์เอ็มของคุณ เรารองรับทุกภาษาโปรแกรม รวมไปถึง PHP, .NET, C#, Java, Python, Ruby และอื่น ๆ";
	$translations['M00480']['Filipino'] = "Ikonekta ang iyong application sa TheNux. Tuklasin kung gaano kadalinh isama ang API  ng TheNux sa iyong website, app, software o application ng CRM. Sinusuportahan namin ang lahat ng mga wika sa programming kabilang ang PHP, .NET, C #, Java, Python, Ruby atbp.";

