	$translations['M00482']['english'] = "A One Time Password (OTP) is a unique code/token generate by your application, sent to a user every time a login attempt is made. Send free OTP via TheNux to save costs, meanwhile maintaining account security.";
	$translations['M00482']['chineseSimplified'] = "一次性密码（OTP）是一组独特的代码，为了确保每一个登录的安全而发送给用户。通过TheNux发送免费OTP能节省成本，同时保持帐户的安全性。";
	$translations['M00482']['chineseTraditional'] = "一次性密碼（OTP）是一組獨特的代碼，為了確保每一個登錄的安全而發送給用戶。通過TheNux發送免費OTP能節省成本，同時保持帳戶的安全性。";
	$translations['M00482']['Malay'] = "A One Time Password (OTP) adalah kod unik / token menjana dengan permohonan anda, yang dihantar kepada pengguna setiap kali percubaan login dibuat.Menghantar OTP percuma melalui TheNux untuk menjimatkan kos, serta mengekalkan keselamatan akaun.";
	$translations['M00482']['Indonesia'] = "A One Time Password (OTP) is a unique code/token generate by your application, sent to a user every time a login attempt is made. Send free OTP via TheNux to save costs, meanwhile maintaining account security.";
	$translations['M00482']['Japanese'] = "ワンタイムパスワード（OTP）は、アプリケーションが生成する一意のコード/トークンであり、ログインが試行されるたびにユーザーに送信されます。アカウントのセキュリティを維持しながら、TheNux経由で無料のOTPを送信してコストを節約します。";
	$translations['M00482']['Korean'] = "저희 보안은 (OTP) 비밀번호가 틀릴때마다 사용자에게 알람이 갑니다. 무료 TheNux OTP를 사용해서 보안을 늘리고 돈을 아끼세요.";
	$translations['M00482']['Spanish'] = "La contraseña de uso único (OTP) es un código / token único generado por su aplicación, que se envía a un usuario cada vez que se realiza un intento de inicio de sesión. Envíe OTP gratis a través de TheNux para ahorrar costos, mientras mantiene la seguridad de la cuenta.";
	$translations['M00482']['Portuguese'] = "Uma Senha de Uso Único (OTP, na sigla em inglês) é um código/token único gerado pelo seu aplicativo, enviado para um usuário toda vez em que uma tentativa de iniciar sessão é feita. Envie a OTP via TheNux para economizar custos, enquanto mantém a segurança da sua conta.";
	$translations['M00482']['Thai'] = "One Time Password หรือรหัส OTP เป็นรหัสที่เฉพาะ/โทเคนที่ถูกสร้างขึ้นโดยแอปพลิเคชันของคุณ ซึ่งจะถูกส่งไปยังผู้ใช้งานทุกครั้งที่มีการลงชื่อเข้าใช้ ส่งรหัส OTP ฟรีผ่าน TheNux เพื่อช่วยประหยัดค่าใช้จ่าย ในขณะที่ยังคงความปลอดภัยอยู่";
	$translations['M00482']['Filipino'] = "Ang Isang Beses na Password (OTP) ay isang natatanging code / token na nilikha ng iyong aplikasyon, na ipinapadala sa isang gumagamit sa tuwing may nagtatangkang mag-login. Magpadala ng libreng OTP sa pamamagitan ng TheNux upang makatipid ng mga gastos, samantalang pinapanatili ang seguridad ng account.";

	$translations['M00483']['english'] = "Replace SMS";
	$translations['M00483']['chineseSimplified'] = "代替付费短信";
