	$translations['M00484']['english'] = "TheNux eliminates your SMS cost, allows you to send bulk text messages to your opted-in customers for free. It is totally free 2-way messaging both locally and internationally, whilst improving and enhancing your customer service.";
	$translations['M00484']['chineseSimplified'] = "TheNux为您节省短信的費用，允許您免費向您選擇加入的客戶發送批量短信。 它在本地和國際上都是完全免費，同時帮助改善和增強您的客戶服務。";
	$translations['M00484']['chineseTraditional'] = "TheNux為您節省短信的費用，允許您免費向您選擇加入的客戶發送批量短信。它在本地和國際上都是完全免費，同時幫助改善和增強您的客戶服務。";
	$translations['M00484']['Malay'] = "TheNux menghapuskan kos SMS anda dan membolehkan anda untuk menghantar mesej teks secara pukal kepada pelanggan pilihan anda secara percuma. Ia adalah mesej 2-hala yang percuma untuk tempatan dan di luar negara, malah ianya dapat memperbaiki dan meningkatkan perkhidmatan pelanggan anda.";
	$translations['M00484']['Indonesia'] = "TheNux menghapuskan biaya SMS anda dan memungkinkan anda untuk mengirim pesan teks massal ke pelanggan (pilihan/opt-in) anda secara gratis. Ini sepenuhnya gratis buat pengiriman pesan 2 arah baik lokal maupun internasional, sambil memperbaiki dan meningkatkan layanan pelanggan anda.";
	$translations['M00484']['Japanese'] = "TheNuxはSMSコストを削減し、オプトインした顧客に無料でバルクテキストメッセージを送信できるようにします。カスタマーサービスを改善および強化しながら、ローカルおよび国際的に完全に無料の双方向メッセージングです。";
	$translations['M00484']['Korean'] = "SMS비용을 없에시고, 고객에게 보내는 문자 비용을 무료로 사용하세요. 세계적으로도 무료입니다.";
	$translations['M00484']['Spanish'] = "TheNux elimina su costo de SMS, le permite enviar mensajes de texto a granel a sus clientes inscritos de forma gratuita. Se trata de mensajes bidireccionales totalmente gratuitos tanto a nivel local como internacional, al tiempo que mejora su servicio al cliente.";
	$translations['M00484']['Portuguese'] = "O TheNux elimina os seus custos de SMS, permitindo que você envie grandes volumes de mensagens de texto para os seus clientes registrados de graça. É um serviço de mensagens de 2 vias gratuito local e internacional, enquanto melhora e aprimora o seu atendimento ao cliente.";
	$translations['M00484']['Thai'] = "TheNux ช่วยลดค่าใช้จ่าย SMS ของคุณ ช่วยให้คุณสามารถส่งข้อความจำนวนมากไปยังลูกค้าที่สมัครรับข่าวสารจากคุณได้ฟรี ส่งข้อความฟรีแบบทั้ง 2 ทาง (ส่ง และรับ) ทั้งท้องถิ่น และนานาชาติ ซึ่งเป็นการช่วยเพิ่มประสิทธิภาพการบริการลูกค้าของคุณให้ดีขึ้น";
	$translations['M00484']['Filipino'] = "Tinatanggal ng TheNux ang iyong gastos sa SMS, nagbibigay-daan sa iyong  magpadala ng maramihang text message sa iyong mga napiling mga customer nang libre. Ito ay ganap na libreng 2-way na pagmemensahe kapwa sa lokal at internasyonal, habang ang pinapabuti at pinapahusay ang iyong serbisyo sa mamimili.";

	$translations['M00485']['english'] = "Understanding the benefits of TheNux API production allows you to unlock the sizable potential";
	$translations['M00485']['chineseSimplified'] = "了解TheNux API生产的利益，您可以解锁相当大的潜力";
	$translations['M00485']['chineseTraditional'] = "了解TheNux API生產的利益，您可以解鎖相當大的潛力";
	$translations['M00485']['Malay'] = "Memahami manfaat TheNux penjanaan API akan membolehkan anda untuk mengeksploitasi faedah yang agak besar";
	$translations['M00485']['Indonesia'] = "Memahami manfaat dari produksi TheNux API membolehkan anda untuk membuka kunci potensi yang cukup besar";
	$translations['M00485']['Japanese'] = "TheNux API制作の利点を理解することで、大きな可能性を引き出すことができます";
	$translations['M00485']['Korean'] = "TheNux API 가져다줄 이득을 알아보세요";
	$translations['M00485']['Spanish'] = "Comprender los beneficios de la producción de TheNux API le permite desbloquear todo el potencial.";
	$translations['M00485']['Portuguese'] = "Entender os benefício da API TheNux permite que você libere o potencial de tamanho considerável";
	$translations['M00485']['Thai'] = "การเข้าใจประโยชน์ของการผลิต API ของ TheNux ช่วยทำให้คุณสามารถปลดล็อกศักยภาพอย่างมากได้";
	$translations['M00485']['Filipino'] = "Ang pag-unawa sa mga pakinabang ng produksiyon ng API ng TheNux ay nagbibigay-daan sa iyong mai-unlock ang napakalaking potensyal";

