	$translations['M00487']['english'] = "TheNux APIs allow machines to handle the workload, which would otherwise require the manual work of a human. This can be as simple as having one content update propagate to multiple users at once.";
	$translations['M00487']['chineseSimplified'] = "TheNux API允许机器来处理工作负载，可以减少对人力资源的需求。";
	$translations['M00487']['chineseTraditional'] = "TheNux API允許機器來處理工作負載，可以減少對人力資源的需求。";
	$translations['M00487']['Malay'] = "API TheNux membolehkan mesin untuk mengendalikan beban kerja, yang jika tidak memerlukan tenaga manual manusia. Ianya mudah seperti mempunyai satu kandungan yang dikemaskini dan disebarkan kepada berbilang pengguna sekaligus";
	$translations['M00487']['Indonesia'] = "APINux memungkinkan mesin untuk menangani beban kerja, yang sebaliknya membutuhkan energi manual. Semudah memiliki konten yang diperbarui dan disebarluaskan ke banyak pengguna sekaligus";
	$translations['M00487']['Japanese'] = "The Nux APIを使用すると、人間の手作業が必要になるワークロードをマシンで処理できます。これは、1つのコンテンツ更新を一度に複数のユーザーに伝達するのと同じくらい簡単です。";
	$translations['M00487']['Korean'] = "TheNux API은 기계가 일할수 있게 합니다. 심플하고 많은 사용자를 수용할수 있습니다";
	$translations['M00487']['Spanish'] = "Las API de TheNux permiten que las máquinas manejen la carga de trabajo, que de otro modo requeriría el trabajo manual de un ser humano. Esto puede ser tan simple como propagar una actualización de contenido a varios usuarios a la vez.";
	$translations['M00487']['Portuguese'] = "A API TheNux permite que máquinas lidem com a carga de trabalho, o que do contrário iria requerer o trabalho manual de um humano. Isso pode ser algo simples como ter uma atualização de conteúdo propaganda para múltiplos usuário de uma vez.";
	$translations['M00487']['Thai'] = "APIs ของ TheNux ช่วยทำให้เครื่องจักรรับมือกับภาระงานได้ ซึ่งปกติจำเป็นต้องมีมนุษย์มาคอยทำงานเอง ทำให้มันง่ายขึ้นเหมือนกับการอัปเดตเนื้อหาเพียงแค่หนึ่งเนื้อหาช่วยทำให้ก็สามารถเผยแพร่ให้กับผู้ใชงานหลายคนได้เพียงแค่ครั้งเดียว";
	$translations['M00487']['Filipino'] = "Pinapayagan ng mga API ng TheNux ang mga makina na pangasiwaan ang workload, na kung hindi man ay nangangailangan ng manu-manong gawain ng isang tao. Maaari itong maging kasing simple ng pagkakaroon ng isang pag-update ng nilalaman na pinalaganap sa maraming mga gumagamit nang sabay-sabay.";

