	$translations['M00489']['english'] = "The users of your website, businesses and non-profits benefit from the ability to personalize sessions with the information and services that are most useful for them.";
	$translations['M00489']['chineseSimplified'] = "您的网站，企业和非营利组织的用户可以个性化的选择对他们最有用的信息和服务。";
	$translations['M00489']['chineseTraditional'] = "您的網站，企業和非營利組織的用戶可以個性化的選擇對他們最有用的信息和服務。";
	$translations['M00489']['Malay'] = "Pengguna laman web anda, perniagaan dan bukan keuntungan mendapat manfaat daripada keupayaan  memperibadikan sesi dengan maklumat dan perkhidmatan yang paling berguna untuk mereka.";
	$translations['M00489']['Indonesia'] = "Pengguna situs web, bisnis, dan nirlaba anda mendapat manfaat dari kemampuan mempersonalisasi sesi dengan informasi dan layanan yang paling berguna bagi mereka.";
	$translations['M00489']['Japanese'] = "ウェブサイト、企業、非営利団体のユーザーは、自分にとって最も役立つ情報やサービスを使用してセッションをパーソナライズすることができます。";
	$translations['M00489']['Korean'] = "웹사이트 사용자, 비지니스, 소득없는 이득의 사용자는 개인적인 세션이 도움이 됩니다.";
	$translations['M00489']['Spanish'] = "Los usuarios de su sitio web, las empresas y las organizaciones sin fines de lucro se benefician de la capacidad de personalizar las sesiones con la información y los servicios que les son más útiles.";
	$translations['M00489']['Portuguese'] = "Os usuários do seu website, empresas e organizações sem fins lucrativos se beneficiam da habilidade de personalizar sessões com as informações e serviços que são mais úteis para eles.";
	$translations['M00489']['Thai'] = "ผู้ใช้งานเว็บไซต์ของคุณ ธุรกิจ และไม่แสวงหาผลกำไรได้รับประโยชน์จากความสามารถในการทำให้ข้อมูล และบริการนั้นเป็นส่วนตัว และเฉพาะเจาะจงมากยิ่งขึ้น โดยเป็นประโยชน์มากที่สุดสำหรับพวกเขา";
	$translations['M00489']['Filipino'] = "Ang mga gumagamit ng iyong website, mga negosyo at non-profit ay nakikinabang mula sa kakayahang i-personalize ang mga sesyon gamit ang impormasyon at mga serbisyo na pinaka-kapaki-pakinabang para sa kanila.";

