	$translations['M00491']['english'] = "TheNux APIs allow your content to be more easily embedded or interwoven to TheNux app. Thus, you can ensure relevant, smooth, up-to-date information and integrated user experience.";
	$translations['M00491']['chineseSimplified'] = "TheNux API允许您的内容更容易被嵌入或交织进TheNux应用。";
	$translations['M00491']['chineseTraditional'] = "TheNux API允許您的內容更容易被嵌入或交織進TheNux應用。";
	$translations['M00491']['Malay'] = "API TheNux membolehkan kandungan anda disematkan atau dipasangkan ke aplikasi TheNux dengan lebih mudah. Oleh itu, anda boleh memastikan maklumat yang berkenaan, lancar dan terkini serta pengalaman pengguna yang bersepadu.";
	$translations['M00491']['Indonesia'] = "API TheNux membolehkan konten anda untuk disematkan atau dipasangkan ke aplikasi TheNux lebih mudah. Oleh karena itu, anda dapat memastikan bahwa informasi itu relevan, lancar dan terkini serta pengalaman pengguna yang terintegrasi.";
	$translations['M00491']['Japanese'] = "TheNux APIを使用すると、コンテンツをより簡単にTheNuxアプリに埋め込んだり織り込んだりできます。したがって、関連性が高く、スムーズで、最新の情報と統合されたユーザーエクスペリエンスを確保できます。";
	$translations['M00491']['Korean'] = "TheNux API는 TheNux 앱에서 많은 유저들이 볼수있게 해줍니다. 이것은 좋고, 실시간 반영되는 정보를 사용가능하게 많들어 드립니다.";
	$translations['M00491']['Spanish'] = "Las API de TheNux permiten que su contenido se incruste o entrelace más fácilmente a la aplicación TheNux. Por lo tanto, puede garantizar información relevante, fluida y actualizada y una experiencia de usuario integrada.";
	$translations['M00491']['Portuguese'] = "A API TheNux permite que o seu conteúdo seja mais facilmente integrado ou entrelaçado ao TheNux. Sendo assim, você pode garantir uma informação relevante, regular e atualizada e uma experiência de usuário integrada.";
	$translations['M00491']['Thai'] = "APIs ของ TheNux APIs ช่วยทำให้เนื้อหาของคุณสามารถถูกฝัง หรือเชื่อมต่อกับแอป TheNux ได้ง่ายมากขึ้น ดังนั้นคุณสามารถมั่นใจได้ในความเกี่ยวข้อง ต่อเนื่องของข้อมูล และผสมผสานเข้ากับประสบการณ์ใช้งานของผู้ใช้";
	$translations['M00491']['Filipino'] = "Binibigyang-daan ng mga API ng TheNux na maging mas madaling mai-embed o maisama ang iyong nilalaman sa app ng TheNux. Kaya, maaari mong masiguro ang nauugnay, maayos, napapanahong impormasyon at pinagsama-samang karanasan ng gumagamit.";

