	$translations['M00493']['english'] = "Providing API access allows content to be automatically published or made available to many channels. Your content is ready for easy sharing and redistribution to deliver your mission directly to more users.";
	$translations['M00493']['chineseSimplified'] = "提供API访问权限允许将内容自动发布内容至TheNux应用。内容共享和再分配的过程将会变得极其简单，直接转发您的信息至更多的用户。";
	$translations['M00493']['chineseTraditional'] = "提供API訪問權限允許將內容自動發佈內容至TheNux應用。內容共享和再分配的過程將會變得極其簡單，直接轉發您的信息至更多的用戶。";
	$translations['M00493']['Malay'] = "Akses kepada API membolehkan kandungan diterbitkan atau disediakan kepada banyak saluran secara automatik. Kandungan anda sedia untuk perkongsian dan pengagihan semula yang mudah untuk menyampaikan misi anda terus kepada lebih ramai pengguna.";
	$translations['M00493']['Indonesia'] = "Akses ke API membolehkan konten dipublikasikan atau disediakan untuk beberapa saluran secara otomatis. Konten anda tersedia untuk berbagi dan redistribusi yang mudah untuk menyampaikan misi anda langsung ke lebih banyak pengguna.";
	$translations['M00493']['Japanese'] = "APIアクセスを提供すると、コンテンツを自動的に公開したり、多くのチャネルで利用できるようになります。コンテンツを簡単に共有および再配布できるようになり、より多くのユーザーにミッションを直接配信できます。";
	$translations['M00493']['Korean'] = "API를 제공한다면 자동적으로 광고가 됩니다. 당신의 컨탠츠가 많은 사람으 사용을 불러옵니다";
	$translations['M00493']['Spanish'] = "El acceso a la API permite que el contenido se publique automáticamente o se ponga a disposición de muchos canales. Su contenido está listo para compartir y redistribuir fácilmente para entregar su misión directamente a más usuarios.";
	$translations['M00493']['Portuguese'] = "Fornecer acesso à API permite que o conteúdo seja publicado automaticamente ou disponibilizado para muitos canais. O seu conteúdo fica pronto para um fácil  compartilhamento e redistribuição para entregar a sua missão diretamente para mais usuários.";
	$translations['M00493']['Thai'] = "การอนุญาตให้เข้าถึง API ทำให้ข้อความสามารถถูกเผยแพร่ได้โดยอัตโนมัติ หรือทำให้เผยแพร่ได้หลายช่องทาง เนื้อหาของคุณพร้อมสำหรับการแชร์อย่างง่ายดาย และสามารถถูกเผยแพร่ซ้ำเพื่อส่งต่อเป้าหมายของคุณไปให้กับผู้ใช้งานมากขึ้น";
	$translations['M00493']['Filipino'] = "Ang pagbibigay ng access sa API ay nagbibigay-daan sa nilalaman na kusang mai-publish o magamit sa maraming mga channel. Handa ang iyong nilalaman para sa madaling pagbabahagi at muling pamamahagi upang maihatid nang direkta ang iyong misyon sa mas maraming mga gumagamit.";

