	$translations['M00495']['english'] = "APIs can be used to distribute information that can be customized to provide tailored user experiences. People who do not come to your website can get information or services from TheNux.";
	$translations['M00495']['chineseSimplified'] = "API可用于分发可定制的信息，以提供定制的用户体验。 未访问您网站的用户可以从TheNux获取信息或服务。";
	$translations['M00495']['chineseTraditional'] = "API可用於分發可定制的信息，以提供定制的用戶體驗。未訪問您網站的用戶可以從TheNux獲取信息或服務。";
	$translations['M00495']['Malay'] = "API boleh digunakan untuk mengedarkan maklumat tertentu untuk memenuhi keperluan individu dan memastikan pengalaman yang sepatutnya. Pengguna yang tidak mengunjungi laman web anda boleh mendapatkan maklumat atau perkhidmatan daripada TheNux";
	$translations['M00495']['Indonesia'] = "API dapat digunakan untuk mendistribusikan informasi spesifik untuk memenuhi kebutuhan individu dan untuk memastikan pengalaman yang tepat. Pengguna yang tidak mengunjungi situs anda dapat memperoleh informasi atau layanan dari TheNux";
	$translations['M00495']['Japanese'] = "APIは、カスタマイズされたユーザーエクスペリエンスを提供するためにカスタマイズできる情報を配布するために使用できます。お客様のウェブサイトに来ない人は、TheNuxから情報やサービスを得ることができます。";
	$translations['M00495']['Korean'] = "API는 맞춤 제작된 정보를 제공합니다. 당신의 웹사이트에 가지 않아도 TheNux에서 필요한 정보를 사람들이 받을수 있습니다";
	$translations['M00495']['Spanish'] = "Las API se pueden usar para distribuir información personalizable para proporcionar experiencias de usuario personalizadas. Las personas que no visitan su sitio web pueden obtener información o servicios de TheNux.";
	$translations['M00495']['Portuguese'] = "A API pode ser usada para distribuir informações que podem ser customizadas para fornecer experiências de usuário sob medida. As pessoas que não vierem ao seu website podem receber informações ou serviços pelo TheNux.";
	$translations['M00495']['Thai'] = "APIs สามารถใช้ในการส่งต่อข้อมูลที่สามารถถูกปรับแต่งได้ตามประสบการณ์ผู้ใช้งาน คนที่ไม่ได้เข้ามายังเว็บไซต์ของคุณยังสามารถได้รับข้อมูล หรือบริการจาก TheNux ได้";
	$translations['M00495']['Filipino'] = "Ang mga API ay maaaring magamit upang ipamahagi ang impormasyon na maaaring ipasadya upang magbigay ng mga naiakmang karanasan sa gumagamit. Ang mga taong hindi pumupunta sa iyong website ay maaaring makakuha ng impormasyon o mga serbisyo mula sa TheNux.";

