	$translations['M00500']['english'] = "Download and install TheNux app from Appstore or Playstore. Open TheNux app and register an account with your mobile number.";
	$translations['M00500']['chineseSimplified'] = "下载并从App store或Play商店中安装TheNux应用。打开TheNux应用并使用您的手机号码注册帐户。";
	$translations['M00500']['chineseTraditional'] = "下載並從App store或Play商店中安裝TheNux應用。打開TheNux應用並使用您的手機號碼註冊帳戶。";
	$translations['M00500']['Malay'] = "Muat turun dan pasang TheNux dengan percuma dari Gedung Aplikasi atau Gedung Play. Buka aplikasi TheNux dan daftar akaun dengan nombor telefon bimbit anda";
	$translations['M00500']['Indonesia'] = "Unduh dan instal TheNux secara gratis dari App Store atau Play Store. Buka aplikasi TheNux dan daftarkan akun dengan nomor telepon anda";
	$translations['M00500']['Japanese'] = "AppstoreまたはプレイストアからTheNuxアプリをダウンロードしてインストールします。 TheNuxアプリを開き、携帯電話番号でアカウントを登録します。";
	$translations['M00500']['Korean'] = "TheNux 앱을 앱스토어 또는 플레이 스토어에서 다운하고 설치하세요. TheNux 앱을 열고 휴대번호를 사용해서 회원가입을 하세요";
	$translations['M00500']['Spanish'] = "Descargue e instale la aplicación TheNux desde Appstore o Playstore. Abra la aplicación TheNux y registre una cuenta con su número de teléfono móvil.";
	$translations['M00500']['Portuguese'] = "Baixe e instale o app TheNux pela Appstore ou Playstore. Abra o TheNux e crie uma conta com o seu número de celular.";
	$translations['M00500']['Thai'] = "ดาวน์โหลด และติดตั้งแอป TheNux จาก Appstore หรือ Playstore เปิดแอป TheNux และสมัครบัญชีด้วยเบอร์โทรศัพท์ของคุณ";
	$translations['M00500']['Filipino'] = "I-download at i-install ang app ng  TheNux mula sa Appstore o Playstore. Buksan ang app ng TheNux at magrehistro ng isang account gamit iyong mobile number.";

