	$translations['M00502']['english'] = "After logging in, on left side menu select “Messenger”, then click “TheNux API”. Click “Generate API Key” on top right side. Please refer our “Documentation” for set up the API.";
	$translations['M00502']['chineseSimplified'] = "登录之后，左侧的菜单中选择“信使”，然后单击“TheNux API”。点击顶部右侧“获取API密钥”。请参考我们的“文档”以建立API。";
	$translations['M00502']['chineseTraditional'] = "登錄之後，左側的菜單中選擇“信使”，然後單擊“TheNux API”。點擊頂部右側“獲取API密鑰”。請參考我們的“文檔”以建立API。";
	$translations['M00502']['Malay'] = "Setelah log masuk, pada menu sebelah kiri pilih \"Messenger\", kemudian klik \"TheNux API\". Klik \"Menjana kunci API \" di sebelah atas kanan. Sila rujuk \"Dokumentasi\" kami untuk menyediakan API.";
	$translations['M00502']['Indonesia'] = "Setelah log masuk, pada menu kiri pilih \"Messenger\", lalu klik \"TheNux API\". Klik \"Hasilkan kunci API\" di kanan atas. Silakan merujuk ke \"Dokumentasi\" kami untuk mengatur API.";
	$translations['M00502']['Japanese'] = "ログイン後、左側のメニューで「メッセンジャー」を選択し、「TheNux API」をクリックします。右上の[APIキーの生成]をクリックします。 APIのセットアップについては、「ドキュメント」を参照してください。";
	$translations['M00502']['Korean'] = "로그인 뒤에 메신저를 눌르고 TheNux API를 눌르고 Generate API Key를 눌르세요. 저희 다큐면트를 보시고 셋업하세요";
	$translations['M00502']['Spanish'] = "Después de iniciar sesión, en el menú del lado izquierdo, seleccione \"Mnsajería\", luego haga clic en \"TheNux API\". Haga clic en \"Generar clave de API\" en la parte superior derecha. Consulte nuestra \"Documentación\" para configurar la API.";
	$translations['M00502']['Portuguese'] = "Depois de iniciar uma sessão, no menu do lado esquerdo selecione “Messenger”, depois clique em “API TheNux”. Clique em “Gerar Chave API” no lado direito. Por favor consulte a nossa “Documentação” para configurar a API.";
	$translations['M00502']['Thai'] = "หลังจากเลงชื่อเข้าใช้ เลือกเมนูด้านซ้าย “Messenger” จากนั้นคลิกที่ “TheNux API” คลิก “สร้างคีย์ API Key” ด้านบนขวา กรุณาทำตาม \"คู่มือ\" ของพวกเราในการตั้งค่า API";
	$translations['M00502']['Filipino'] = "Matapos mag-log in, sa kaliwang bahagi ng menu piliin ang \"Messenger\", pagkatapos ay i-click ang \"API ng TheNux\". I-click ang \"Bumuo ng key ng API\" sa itaas ng kanang sulok. Mangyaring tingnan ang aming \"Dokumentasyon\" para sa pag-set up ng API.";

