	$translations['M01307']['english'] = "Before you start OTC trading you need to consider what payment methods you are going to provide and research the payment method so that you know how it works. When you first start trading, we recommend you don't choose a high-risk payment method. Transfer with specific local bank can be a good starting payment method, especially if there are few traders active in your country.";
	$translations['M01307']['chineseSimplified'] = "开始之前OTC交易，您需​​要考虑您打算什么付款方式提供，并让您知道它是如何工作研究的付款方式。当您第一次开始交易，我们建议您不要选择高风险的付款或收款方式。选择特定的本地银行可能是一个很好的开始。";
	$translations['M01307']['chineseTraditional'] = "開始之前OTC交易，您需​​要考慮您打算什麼付款方式提供，並讓您知道它是如何工作研究的付款方式。當您第一次開始交易，我們建議您不要選擇高風險的付款或收款方式。選擇特定的本地銀行可能是一個很好的開始。";
	$translations['M01307']['Malay'] = "Sebelum memulakan perdagangan OTC, anda perlu mempertimbangkan kaedah pembayaran yang akan anda tawarkan dan selidik kaedah pembayaran tersebut supaya anda tahu bagaimana ianya berfungsi. Apabila anda memulakan perdagangan, kami mengesyorkan anda tidak memilih kaedah pembayaran yang berisiko tinggi. Pemindahan wang dengan bank tempatan yang tertentu boleh menjadi kaedah pembayaran permulaan yang baik, terutamanya jika terdapat beberapa pedagang yang aktif di negara anda.";
	$translations['M01307']['Indonesia'] = "Sebelum anda memulai perdagangan OTC, anda perlu mempertimbangkan metode pembayaran apa yang akan anda tawarkan dan teliti metode pembayaran sehingga anda tahu cara fungsinya. Saat pertama kali memulai perdagangan, kami sarankan anda tidak memilih metode pembayaran yang berisiko tinggi. Transfer wang dengan bank lokal tertentu akan dapat menjadi metode pembayaran awal yang baik, terutama jika ada beberapa pedagang yang aktif di negara anda.";
	$translations['M01307']['Japanese'] = "OTC取引を開始する前に、提供する支払い方法を検討し、支払い方法を調査して、その仕組みを理解する必要があります。 初めて取引を開始するときは、リスクの高い支払い方法を選択しないことをお勧めします。 特にお客様の国でアクティブなトレーダーがほとんどいない場合、特定の地元の銀行との振替は良い開始方法です。";
	$translations['M01307']['Korean'] = "OTC 교환을 시작하기전에 지불방법을 고려해보세요. 지불 방법에 대해서 알아보세요. 처음 교환하는 만큼 저희는 위험한 지불방법을 추천하지 않습니다. 특정한 지불 방법으로는 은행을 사용하는 것을 추천합니다";
	$translations['M01307']['Spanish'] = "Antes de comenzar a operar con OTC, debe considerar qué métodos de pago va a proporcionar e investigar el método de pago para saber cómo funciona. Cuando empiece a operar, le recomendamos que no elija un método de pago de alto riesgo. La transferencia con un banco local específico puede ser un buen método de pago inicial, especialmente si hay pocos comerciantes activos en su país.";
	$translations['M01307']['Portuguese'] = "Antes de começar com a negociação OTC, você precisa considerar quais métodos de pagamento você irá oferecer e pesquisar sobre o método de pagamento para que você possa saber como ele funciona. Quando você começar a negociar, nós recomendamos que você não escolha um método de pagamento de alto risco. Transferir com um banco local específico pode ser um bom método de pagamento inicial, especialmente se houver poucos negociantes ativos no seu país.";
	$translations['M01307']['Thai'] = "ก่อนที่คุณจะเริ่มเทรดซื้อขายกันเอง (OTC) คุณต้องพิจารณาว่าวิธีการชำระเงินแบบไหนที่คุณต้องการใช้ และศึกษาวิธีการชำระเงินเพื่อคุณจะได้เรียนรู้วิธีการทำงานของมัน เมื่อมีเทรดเดอร์ไม่กี่คนในประเทศของคุณ";
	$translations['M01307']['Filipino'] = "Bago mo simulan ang kalakalang OTC kailangan mong isaalang-alang kung ano ang mga pamamaraan ng pagbabayad na iyong ibibigay at saliksikin ang paraan ng pagbabayad upang malaman mo kung paano ito ginagamit. Sa iyong pagsisimula sa pangangalakal, inirerekumenda namin na huwag mong piliin ang isang paraan ng pagbabayad na mapanganib. Ang paglipat sa isang tiyak na lokal na bangko ay maaaring maging isang mainam na paraan ng pagbabayad sa pasimula, lalo na kung may iilang mangangalakal lamang na aktibo sa iyong bansa.";

	$translations['M01308']['english'] = "If you have a new account with no previous trading history, we recommend you start by place order to existing advertisements for buy and sell cryptocurrency. This will help you get an idea of how OTC trading works and it will let you build some trading history which will make your accounttrustworthy which in turn gives your advertisements better placement in the listings.";
	$translations['M01308']['chineseSimplified'] = "如果您是一个新账户，并且没有交易历史，我们建议您以下订单的方式开始交易，对现有广告进行买入和卖出加密货币。这将帮助您了解OTC交易如何运作，它也会让您累计一些交易历史，这将提高您的帐户交易可信度。";
	$translations['M01308']['chineseTraditional'] = "如果您是一個新賬戶，並且沒有交易歷史，我們建議您以下訂單的方式開始交易，對現有廣告進行買入和賣出加密貨幣。這將幫助您了解OTC交易如何運作，它也會讓您累計一些交易歷史，這將提高您的帳戶交易可信度。";
	$translations['M01308']['Malay'] = "Sekiranya anda mempunyai akaun baru tanpa sejarah perdagangan sebelumnya, kami mengesyorkan anda memulakan pesanan dengan iklan sedia ada untuk membeli dan menjual cryptocurrency. Ini akan membantu anda mendapatkan idea bagaimana perdagangan OTC berfungsi dan ia akan membolehkan anda membina beberapa sejarah perdagangan yang akan menjadikan akaun anda boleh dipercayai yang seterusnya memberikan penempatan iklan anda lebih baik dalam senarai tersebut.";
	$translations['M01308']['Indonesia'] = "Jika anda memiliki akun baru tanpa sejarah perdagangan sebelumnya, kami menyarankan anda untuk mulai dengan  pesanan untuk iklan yang ada untuk membeli dan menjual cryptocurrency. Ini akan membantu anda mendapatkan ide tentang bagaimana perdagangan OTC bekerja dan itu akan memungkinkan anda membangun beberapa sejarah perdagangan yang akan membuat akun anda dapat dipercaya dan akan memberi iklan anda penempatan yang lebih baik dalam daftar.";
	$translations['M01308']['Japanese'] = "以前の取引履歴のない新しいアカウントを持っている場合、仮想通貨の売買のために既存の広告の場所順から始めることをお勧めします。これにより、OTC取引の仕組みを理解し、取引履歴を構築してアカウントを信頼できるものにすることができます。これにより、広告の掲載順位が向上します。";
	$translations['M01308']['Korean'] = "이것이 새 계정이고 교환을 이전에 해보기 않으셨다면 저희는 광고를 통해서 크립토커런시를 사고 파는 것을 추천합니다. 이것은 OTC 교환이 어떻게 되는지 알수 있을겁니다. 그리고 이것은 교환 역사를 만들어서 신뢰를 싸을수 있습니다.";
	$translations['M01308']['Spanish'] = "Si tiene una cuenta nueva sin historial comercial anterior, le recomendamos que comience por realizar un pedido a los anunciantes existentes para comprar y vender criptomonedas. Esto lo ayudará a tener una idea de cómo funciona el comercio OTC y le permitirá construir un historial comercial que hará que su cuenta sea confiable, lo que a su vez le dará a sus anuncios una mejor ubicación en los listados.";
	$translations['M01308']['Portuguese'] = "Se você tiver uma conta nova, sem histórico prévio de negociação, nós recomendamos que você comece fazendo pedidos em anúncios existentes para comprar e vender criptomoedas. Isso irá ajudar você a criar algum histórico de negociação, o que irá tornar a sua conta mais confiável, o que por sua vez, dará aos seus anúncios um melhor posicionamento nas listagens.";
	$translations['M01308']['Thai'] = "ถ้าหากคุณมีบัญชีใหม่ที่ไม่มีประวัติการเทรดมาก่อน เราแนะนำให้คุณเริ่มต้นด้วยการวางออเดอร์ในโฆษณาที่มีอยู่ก่อนแล้วเพื่อซื้อ และขายสกุลเงินคริปโต นี่จะช่วยให้คุณเข้าใจว่าการเทรดแบบ OTC ทำอย่างไร และทำให้บัญชีของคุณมีประวัติการเทรด ซึ่งช่วยสร้างความน่าเชื่อถือ ทำให้โฆษณาของคุณได้ลำดับที่ดีมากขึ้น";
	$translations['M01308']['Filipino'] = "Kung mayroon kang isang bagong account na walang nakaraang kasaysayan ng pangangalakal, inirerekumenda namin na magsimula ka sa pamamagitan ng paglagay ng order sa umiiral na mga patalastas para bumili at magbenta ng cryptocurrency. Makakatulong ito sa iyo na makakuha ng isang ideya kung paano isinasagawa ang kalakalan ng OTC at magbibigay daan ito sa iyong makapagtatag ng ilang kasaysayan sa pangangalakal na gagawing mapagkakatiwalaan ang iyong account na kung saan ay magbibigay sa iyong mga ad ng mas mainam na puwesto sa mga listahan.";

