	$translations['M01311']['english'] = "First time user? Open Wallets in TheNux to create a crypto wallet for your account, you need a to start trading. Start out by place order at other traders ads to buy and sell, this help you get your first rating and trade completions. The higher rating and more feedback you have, the more trustworthy you are.";
	$translations['M01311']['chineseSimplified'] = "初次登录的用户？在TheNux打开钱包，为您的帐户密码的钱包，您需要一个钱包，开始交易。我们建议您先在其他交易员的广告购买和出售下订单，这可以帮助您得到您的第一个评级和交易历史。拥有较高的评级和更多的反馈是您的账户值得信赖。";
	$translations['M01311']['chineseTraditional'] = "初次登錄的用戶？在TheNux打開錢包，為您的帳戶密碼的錢包，您需要一個錢包，開始交易。我們建議您先在其他交易員的廣告購買和出售下訂單，這可以幫助您得到您的第一個評級和交易歷史。擁有較高的評級和更多的反饋是您的賬戶值得信賴。";
	$translations['M01311']['Malay'] = "Pengguna pertama kali? Buka Dompet di TheNux untuk mencipta dompet crypto untuk akaun anda, anda memerlukan dompet untuk memulakan perdagangan. Mulakan dengan membuat pesanan  dengan iklan perdagangan yang lain untuk membeli dan menjual, ini akan membantu anda untuk mendapatkan penarafan pertama dan juga penyelesaian perdagangan anda. Semakin tinggi penarafan dan banyak maklum balas yang anda miliki, maka anda akan lebih dipercayai.";
	$translations['M01311']['Indonesia'] = "Pengguna pertama kali? Buka Dompet di TheNux untuk mencipta dompet crypto untuk akun anda, Anda membutuhkan dompet untuk memulai perdagangan. Mulailah dengan memesan di iklan pedagang lain untuk membeli dan menjual, ini membantu anda untuk mendapatkan peringkat pertama dan juga penyelesaian buat perdagangan anda. Semakin tinggi peringkat anda dan semakin banyak umpan balik yang anda miliki, semakin anda dapat lebih dipercaya.";
	$translations['M01311']['Japanese'] = "初めてのユーザーですか？ TheNuxでウォレットを開き、アカウントの暗号ウォレットを作成します。取引を開始する必要があります。他のトレーダー広告での売買注文から始めてください。これにより、最初の格付けと取引完了を取得できます。評価が高く、フィードバックが多いほど、信頼性が高くなります。";
	$translations['M01311']['Korean'] = "처음하는 사용자세요? TheNux 만든 지갑을 열고 다름 사람들과 교환을 해보세요. 광고를 통해서 사고 파세요. 이것은 신뢰도를 높일것입니다.";
	$translations['M01311']['Spanish'] = "¿Usuario por primera vez? Abra billeteras en TheNux para crear una billetera criptográfica para su cuenta, necesita una para comenzar a operar. Comience por realizar pedidos en otros anuncios de comerciantes para comprar y vender, esto le ayuda a obtener su primera calificación y finalización de operaciones. Cuanto mayor sea la calificación y más comentarios tenga, más confiable será.";
	$translations['M01311']['Portuguese'] = "Usuário de primeira viagem? Abra Carteiras no TheNux para criar uma carteira de criptomoedas para a sua conta, você precisa de uma para começar a negociar. Comece fazendo um pedido nos anúncios de outros negociantes para comprar e vender, isso irá ajudar você a ter sua primeira avaliação e conclusão de negociação. Quanto maior a sua avaliação e quanto mais feedback você tiver, mais confiável você será.";
	$translations['M01311']['Thai'] = "เป็นผู้ใช้งานครั้งแรก? เปิด Wallet ใน TheNux เพื่อสร้าง Crypto Wallet สำหรับบัญชีของคุณ คุณต้องเริ่มเทรด โดยเริ่มด้วยการวางออเดอร์บนโฆษณาของเทรดเดอร์คนอื่นเพื่อซื้อ และขาย นี่จะช่วยทำให้คุณได้เรทติ้งครั้งแรก และมีประวัติการซื้อขายที่เสร็จสมบูรณ์ ยิ่งมีเรทติ้ง และข้อเสนอมากเท่าไหร่ คุณก็ยิ่งน่าเชื่อถือมากเท่านั้น";
	$translations['M01311']['Filipino'] = "Unang beses na gumagamit? Buksan ang Mga Wallet sa TheNux upang lumikha ng isang wallet ng crypto para sa iyong account, kailangan mo ito upang makapagsimula sa kalakalan. Magsimula sa pamamagitan ng pag-order sa mga ad sa pagbili at pagbenta ng iba pang mga mangangalakal, makakatulong ito sa iyong makakuha ng iyong unang rating at pagkumpleto sa kalakalan. Mas mataas ang rating at mas maraming feedback ang mayroon ka, mas maaasahan ka.";

