	$translations['M01313']['english'] = "It's also a good idea to verify your account by completing both the National ID or Passport. A verified account is more trustworthy for buyers and will help you get more customers. You can verify your account insidethe account setting.";
	$translations['M01313']['chineseSimplified'] = "通过完成国家身份证或护照以验证您的帐户。验证帐户使买家更值得信赖，并会帮助您获得更多的客户。您可以从帐户设置中验证您的身份。";
	$translations['M01313']['chineseTraditional'] = "通過完成國家身份證或護照以驗證您的帳戶。驗證帳戶使買家更值得信賴，並會幫助您獲得更多的客戶。您可以從帳戶設置中驗證您的身份。";
	$translations['M01313']['Malay'] = "Ianya idea yang baik untuk supaya mengesahkan akaun anda dengan melengkapkan kedua-dua ID Kebangsaan atau Pasport. Akaun yang telah disahkan akanlebih dipercayai oleh pembeli dan akan membantu anda mendapatkan lebih ramai pelanggan. Anda boleh mengesahkan akaun anda dalam tetapan akaun.";
	$translations['M01313']['Indonesia'] = "Ini juga merupakan ide yang baik untuk memverifikasi akun anda dengan melengkapi ID Nasional atau Paspor. Akun yang terverifikasi lebih dapat dipercaya oleh pembeli dan akan membantu anda mendapatkan lebih banyak pelanggan. Anda dapat memverifikasi akun Anda di dalam pengaturan akun.";
	$translations['M01313']['Japanese'] = "また、国民IDまたはパスポートの両方を入力してアカウントを確認することをお勧めします。確認済みのアカウントは購入者にとってより信頼性が高く、より多くの顧客を獲得するのに役立ちます。アカウント設定内でアカウントを確認できます。";
	$translations['M01313']['Korean'] = "계정을 여권으로 인증하는 것은 중요합니다. 계정을 인증하는 것은 신뢰를 높일수 있습니다";
	$translations['M01313']['Spanish'] = "También es una buena idea verificar su cuenta completando la identificación nacional o con el pasaporte. Una cuenta verificada es más confiable para los compradores y lo ayudará a obtener más clientes. Puede verificar su cuenta dentro de la configuración de la cuenta.";
	$translations['M01313']['Portuguese'] = "É uma boa ideia verificar a sua conta completando a Carteira de Identidade ou o Passaporte. Uma conta verificada é mais confiável para os compradores e irá ajudar você a receber mais clientes. Você pode verificar a sua conta dentro das configurações de conta.";
	$translations['M01313']['Thai'] = "ควรยืนยันบัญชีของคุณด้วยบัตรประชาชน หรือพาสปอร์ต บัญชีที่ได้รับการยืนยันน่าเชื่อถือมากกว่าสำหรับผู้ซื้อ และช่วยทำให้คุณได้ลูกค้าเพิ่มมากขึ้น คุณสามารถยืนยันบัญชีของคุณได้ในการตั้งค่าบัญชี";
	$translations['M01313']['Filipino'] = "Magandang ideya din na beripikahin ang iyong account sa pamamagitan ng pagkumpleto kapwa ng Pambansang ID o Pasaporte. Ang isang napatunayan na account ay mas mapagkakatiwalaan para sa mga mamimili at makakatulong sa iyo na makakuha ng mas maraming mga mamimili. Maaari mong beripikahin ang iyong account sa loob ng setting ng account";

	$translations['M01314']['english'] = "Research the payment method you're going to offer";
	$translations['M01314']['chineseSimplified'] = "研究与了解您所选择的付款或收款方式";
	$translations['M01314']['chineseTraditional'] = "研究與了解您所選擇的付款或收款方式";
	$translations['M01314']['Malay'] = "Selidik kaedah pembayaran yang akan anda tawarkan";
	$translations['M01314']['Indonesia'] = "Teliti metode pembayaran yang akan anda tawarkan";
	$translations['M01314']['Japanese'] = "提供します支払い方法を調査します";
	$translations['M01314']['Korean'] = "지불 방법을 찾아보세요";
	$translations['M01314']['Spanish'] = "Investigue el método de pago que ofrecerá";
	$translations['M01314']['Portuguese'] = "Pesquise sobre o método de pagamento que você irá oferecer";
	$translations['M01314']['Thai'] = "ศึกษาวิธีการชำระเงินที่คุณต้องการใช้";
	$translations['M01314']['Filipino'] = "Saliksikin ang paraan ng pagbabayad na iyong ia-alok";

	$translations['M01315']['english'] = "Read through other traders advertisement of the same payment method and make some trades with them. Try to identify possible problems before you start trading. We recommend you start trading using a low risk payment method.";
	$translations['M01315']['chineseSimplified'] = "您可以从其他买卖家广告寻找与您一样的付款或收款方式, 并与他们进行一些交易。在开始交易之前尝试识别可能发生的问题。 我们建议您使用低风险付款方式开始交易。";
	$translations['M01315']['chineseTraditional'] = "您可以從其他買賣家廣告尋找與您一樣的付款或收款方式, 並與他們進行一些交易。在開始交易之前嘗試識別可能發生的問題。我們建議您使用低風險付款方式開始交易。";
	$translations['M01315']['Malay'] = "Baca iklan dari peniaga lain iklan yang mempunyai kaedah pembayaran yang sama dan cuba untuk membuat beberapa perdagangan dengan mereka. Cubalah untuk mengenal pasti tentang kemungkinan masalah sebelum memulakan perdagangan. Kami mengesyorkan anda memulakan perdagangan dengan menggunakan kaedah pembayaran risiko yang rendah.";
	$translations['M01315']['Indonesia'] = "Baca iklan dari pedagang lain yang memiliki metode pembayaran yang sama dan lakukan beberapa perdagangan dengan mereka. Cobalah untuk mengidentifikasi tentang kemungkinan masalah sebelum anda memulai perdagangan. Kami menyarankan anda memulai perdagangan menggunakan metode pembayaran yang berisiko rendah.";
	$translations['M01315']['Japanese'] = "同じ支払い方法の他のトレーダー広告を読んで、彼らといくつかの取引をしてください。取引を開始する前に、起こりうる問題を特定してください。低リスクの支払い方法を使用して取引を開始することをお勧めします。";
	$translations['M01315']['Korean'] = "광고를 읽어 보시고 교환을 해보세요. 교환을 시작하기 전에 문제가 있는지 확인하세요. 처음에는 가격이 싼 비용지불 방법을 사용 하는것을 추천합니다.";
	$translations['M01315']['Spanish'] = "Lea el anuncio de otros comerciantes del mismo método de pago y realice algunas transacciones con ellos. Intente identificar posibles problemas antes de comenzar a operar. Le recomendamos comenzar a operar utilizando un método de pago de bajo riesgo.";
	$translations['M01315']['Portuguese'] = "Leia os anúncios de outros negociantes com o mesmo método de pagamento e faça algumas negociações com eles. Tente identificar possíveis problemas antes de começar a negociar. Nós recomendamos que você comece a negociar usando um método de pagamento de risco baixo.";
	$translations['M01315']['Thai'] = "อ่านโฆษณาของเทรดเดอร์คนอื่นที่ใช้วิธีการชำระเงินแบบเดียวกัน และเทรดกับพวกเขาดู พยายามหาปัญหาที่อาจจะเกิดขึ้นก่อนที่คุณจะเริ่มเทรด เราแนะนำให้คุณเริ่มเทรดโดยใช้วิธีการชำระเงินที่มีความเสี่ยงต่ำก่อน";
	$translations['M01315']['Filipino'] = "Basahin ang iba pang mga patalastas ng mga mangangalakal na gumagamit  ng parehong paraan ng pagbabayad at gumawa ng ilang mga kalakalan sa kanila. Subukang kilalanin ang mga posibleng problema bago ka magsimulang makipagkalakalan. Inirerekumenda namin na simulang makipagkalakalan gamit ang isang paraan ng pagbabayad na may mababang panganib.";

	$translations['M01316']['english'] = "Use payment accounts only for Crypto trading";
	$translations['M01316']['chineseSimplified'] = "使用只用于加密货币交易的支付账户";
	$translations['M01316']['chineseTraditional'] = "使用只用於加密貨幣交易的支付賬戶";
	$translations['M01316']['Malay'] = "Gunakan akaun pembayaran hanya untuk perdagangan Crypto";
	$translations['M01316']['Indonesia'] = "Gunakan akun pembayaran hanya untuk perdagangan Crypto";
	$translations['M01316']['Japanese'] = "暗号取引のみに支払いアカウントを使用します";
	$translations['M01316']['Korean'] = "지불 방법을 크립토 교환을 사용하세요";
	$translations['M01316']['Spanish'] = "Use cuentas de pago solo para el comercio de criptomonedas";
	$translations['M01316']['Portuguese'] = "Use contas de pagamento apenas para negociação de Criptomoedas";
	$translations['M01316']['Thai'] = "ใช้บัญชีชำระเงินสำหรับการเทรดคริปโตเท่านั้น";
	$translations['M01316']['Filipino'] = "Gumamit lamang ng mga account sa pagbabayad para sa kalakalan ng Crypto";

	$translations['M01317']['english'] = "Some payment providers will temporarily or permanently close your account if you receive unauthorized payments that are related to fraud. Using accounts only for Crypto trading protects your personal finances.";
	$translations['M01317']['chineseSimplified'] = "如果您收到与欺诈相关的未经授权的付款，某些付款服务提供商将暂时或永久关闭您的帐户。 使用特定账户加密货币交易进行交易可以保护您的个人财务。";
	$translations['M01317']['chineseTraditional'] = "如果您收到與欺詐相關的未經授權的付款，某些付款服務提供商將暫時或永久關閉您的帳戶。使用特定賬戶加密貨幣交易進行交易可以保護您的個人財務。";
	$translations['M01317']['Malay'] = "Sesetengah pembekal pembayaran akan menutup akaun anda secara sementara atau secara kekal jika anda menerima pembayaran tidak sah yang berkaitan dengan penipuan. Gunakan akaun hanya untuk perdagangan Crypto untuk melindungi kewangan peribadi anda.";
	$translations['M01317']['Indonesia'] = "Beberapa penyedia pembayaran akan menutup sementara atau secara permanen akun anda jika anda menerima pembayaran tidak sah yang terkait dengan penipuan. Gunakan akun hanya untuk perdagangan Crypto untuk melindungi keuangan pribadi anda.";
	$translations['M01317']['Japanese'] = "一部の支払いプロバイダーは、不正に関連する不正な支払いを受け取った場合、アカウントを一時的または永久に閉鎖します。暗号取引のみにアカウントを使用すると、個人の財務が保護されます。";
	$translations['M01317']['Korean'] = "몇몇 지불 프로바이더는 잠시동안 또는 평생 당신의 계정을 멈출수 있습니다. 사기, 인증되지 않은 지불 방법, 등은 계정을 영정할수 있습니다.";
	$translations['M01317']['Spanish'] = "Algunos proveedores de pagos cerrarán su cuenta de manera temporal o permanente si recibe pagos no autorizados relacionados con fraude. El uso de cuentas solo para Crypto trading (Comercio de criptomonedas) protege sus finanzas personales.";
	$translations['M01317']['Portuguese'] = "Alguns provedores de pagamentos irão fechar a sua conta temporária ou permanentemente se você receber pagamentos não autorizados que estão relacionados a fraudes. Usar as contas para negociar apenas Criptomoedas protege as suas finanças pessoais.";
	$translations['M01317']['Thai'] = "ผู้ให้บริการชำระเงินบางรายจะปิดบัญชีของคุณชั่วคราว หรือถาวร ถ้าหากคุณได้รับการชำระเงินที่ไม่ได้รับอนุญาตที่เกี่ยวข้องกับการฉ้อโกง การใช้บัญชีสำหรับการเทรดคริปโตเท่านั้นจะช่วยปกป้องการเงินของคุณได้";
	$translations['M01317']['Filipino'] = "Ang ilang mga nagbibigay ng bayad ay pansamantala o permanenteng isasara ang iyong account kung nakatanggap ka ng hindi awtorisadong bayad na nauugnay sa pandaraya. Ang paggamit ng mga account para lamang sa kalakalang Crypto ay pinoprotektahan ang iyong personal na pananalapi.";

