	$translations['M01319']['english'] = "xChange is where you create new advertisements. You can find it inside TheNux App.";
	$translations['M01319']['chineseSimplified'] = "您可以通过xChange创建新的广告。您可以在TheNux应用里找到它。";
	$translations['M01319']['chineseTraditional'] = "您可以通過xChange創建新的廣告。您可以在TheNux應用裡找到它。";
	$translations['M01319']['Malay'] = "xChange adalah tempat anda mencipta iklan baru. Anda boleh menemuinya di dalam TheNux App.";
	$translations['M01319']['Indonesia'] = "xChange adalah tempat anda mencipta iklan baru. Anda dapat menemukannya di dalam TheNux App.";
	$translations['M01319']['Japanese'] = "xChangeは、新しい広告を作成する場所です。 TheNuxアプリ内で見つけることができます。";
	$translations['M01319']['Korean'] = "엑스체인지는 광고를 만들수 있는데 입니다";
	$translations['M01319']['Spanish'] = "xChange es donde crea nuevos anuncios. Puede encontrarlo dentro de la aplicación TheNux.";
	$translations['M01319']['Portuguese'] = "O xChange é onde você cria novos anúncios. Você pode encontrá-lo dentro do App TheNux.";
	$translations['M01319']['Thai'] = "xChange เป็นที่ที่คุณจะสร้างโฆษณาตัวใหม่ คุณสามารถหามันได้ในแอป TheNux";
	$translations['M01319']['Filipino'] = "Ang xChange ay kung saan ka lumilikha ng mga bagong patalastas. Maaari mo itong mahanap sa loob ng App ng TheNux.";

	$translations['M01320']['english'] = "There are some options when creating an advertisement which are required, and we will have an Info and Remarks section for you to write down important message. Using the Info and Remarks section allows your buyer or seller understand more about your advertisement before they place order.";
	$translations['M01320']['chineseSimplified'] = "在创建广告时有一些选项须设置，我们将有一个信息和备注部分供您写下重要消息。 使用“信息”和“备注”部分让您的买家或卖家可以在下订单之前了解您的广告。";
	$translations['M01320']['chineseTraditional'] = "在創建廣告時有一些選項須設置，我們將有一個信息和備註部分供您寫下重要消息。使用“信息”和“備註”部分讓您的買家或賣家可以在下訂單之前了解您的廣告。";
	$translations['M01320']['Malay'] = "Terdapat beberapa pilihan apabila mencipta iklan yang diperlukan dan kami  mempunyai bahagian Info dan Catatan untuk anda tuliskan pesanan penting. Menggunakan bahagian Info dan pernyataan membolehkan pembeli atau penjual anda memahami lebih lanjut mengenai iklan anda sebelum mereka membuat sebarang pesanan.";
	$translations['M01320']['Indonesia'] = "Ada beberapa opsi ketika mencipta iklan yang diperlukan dan kami  memiliki bagian Info dan Keterangan untuk anda tuliskan pesanan penting. Menggunakan bagian Info dan Keterangan memungkinkan pembeli atau penjual anda lebih memahami tentang iklan anda sebelum melakukan pemesanan.";
	$translations['M01320']['Japanese'] = "広告を作成する際に必要ないくつかのオプションがあり、重要なメッセージを書き留めておくための情報と注釈セクションがあります。 [情報と備考]セクションを使用すると、買い手または売り手は注文する前に広告についてより深く理解できます。";
	$translations['M01320']['Korean'] = "몇 옵션은 관고를 만드는데 꼭 필요한 조건입니다. 이 조건을 사용하는 것은 구매자나 판매자한테 더 많은 정보를 제공합니다.";
	$translations['M01320']['Spanish'] = "Hay algunas opciones al crear un anuncio que son necesarias, y tendremos una sección de Información y Comentarios para que escriba un mensaje importante. El uso de la sección Información y comentarios le permite a su comprador o vendedor comprender más acerca de su anuncio antes de realizar el pedido.";
	$translations['M01320']['Portuguese'] = "Existem algumas opções ao criar um anúncio que são obrigatórias, e nós teremos uma seção de Informações e Observações para que você escreva mensagens importantes. Usar a seção de Informações e Observações permite que seu comprador ou vendedor entenda mais sobre o seu anúncio antes de fazer o pedido.";
	$translations['M01320']['Thai'] = "มีตัวเลือกบางอย่างที่จำเป็นเมื่อสร้างโฆษณาแล้ว และเราจะมีส่วนข้อมูล และหมายเหตุในการเขียนข้อความที่สำคัญ โดยการใช้งานส่วนข้อมูล และหมายเหตุเหล่านี้จะช่วยทำให้ผู้ซื้อ และผู้ขายของคุณเข้าใจโฆษณาของคุณมากขึ้นก่อนวางออเดอร์";
	$translations['M01320']['Filipino'] = "Mayroong ilang mga pagpipilian kapag lumilikha ng isang patalastas na kinakailangan, at magkakaroon kami ng isang seksyon ng Impormasyon at Mga Puna upang iyong isulat ang mahahalagang mensahe. Ang paggamit ng seksyon ng Impormasyon at Puna ay nagbibigay-daan sa iyong mamimili o nagbebenta na maunawaan nang higit pa ang tungkol sa iyong patalastas bago sila mag-order.";

	$translations['M01321']['english'] = "You can find all of the advertisements that you have created from your Manage Advertisement. When you click your advertisement from Manage Advertisement list, you can see all of your order, open, closed, cancelled and expired.";
	$translations['M01321']['chineseSimplified'] = "您可以在“管理广告”中找到您创建的所有广告。 当您从“管理广告”列表中单击广告时，您可以查看所有订单，包括正在进行中, 已完成和已取消的订单。";
	$translations['M01321']['chineseTraditional'] = "您可以在“管理廣告”中找到您創建的所有廣告。當您從“管理廣告”列表中單擊廣告時，您可以查看所有訂單，包括正在進行中, 已完成和已取消的訂單。";
	$translations['M01321']['Malay'] = "Anda boleh menemui semua iklan yang telah anda cipta dari Pengurusan Iklan anda. Apabila anda mengklik iklan anda dari senarai Pengurusan Iklan, anda dapat melihat semua pesanan anda yang terbuka, ditutup, dibatalkan dan tamat tempoh.";
	$translations['M01321']['Indonesia'] = "Anda boleh menemukan semua iklan yang telah anda cipta dari Kelola Iklan anda. Ketika Anda mengklik iklan Anda dari daftar Kelola Iklan, anda dapat melihat semua pesanan anda yang terbuka, tertutup, dibatalkan, dan kedaluwarsa.";
	$translations['M01321']['Japanese'] = "広告の管理から作成したすべての広告を見つけることができます。 [広告の管理]リストから広告をクリックすると、注文、オープン、クローズ、キャンセル、期限切れのすべてを確認できます。";
	$translations['M01321']['Korean'] = "모든 광고는 광고 관리에서 관리가 가능합니다. 광고를 눌르고 관리에서 열고, 닫고, 취소, 등이 가능합니다";
	$translations['M01321']['Spanish'] = "Puede encontrar todos los anuncios que ha creado en Administrar Anuncio. Cuando hace clic en su anuncio desde la lista Administrar Anuncio, puede ver todos sus pedidos, abiertos, cerrados, cancelados y vencidos.";
	$translations['M01321']['Portuguese'] = "Você pode encontrar todos os anúncios que você criou em Gerenciar Anúncios. Quando você clica no seu anúncio na lista Gerenciar Anúncios, você pode ver todos os seus pedidos, abertos, fechados, cancelados e vencidos.";
	$translations['M01321']['Thai'] = "คุณสามารถค้นหาโฆษณาทั้งหมดที่คุณได้สร้างจากการจัดการโฆษณาของคุณ เมื่อคุณคลิกโฆษณาของคุณจากรายการจัดการโฆษณา คุณสามารถเห็นออเดอร์ทั้งหมดของคุณ order, ทั้งเปิด ปิด ยกเลิก และหมดอายุ";
	$translations['M01321']['Filipino'] = "Maaari mong makita ang lahat ng mga patalastas na iyong nilikha mula sa iyong Pamahalaan ang Patalastas. Kapag na-click mo ang iyong patalastas mula sa talaan ng Pamahalaan ang Patalastas, makikita mo ang lahat ng iyong order, bukas, sarado, kinansela at nag-expire.";

