	$translations['M01323']['english'] = "You need to choose buy or sell advertisement, currency, payment method, price, limits and write a terms of trade.";
	$translations['M01323']['chineseSimplified'] = "您需要选择要创建买入或卖出广告，货币种类，付款方式，价格，限额并写出交易条款。";
	$translations['M01323']['chineseTraditional'] = "您需要選擇要創建買入或賣出廣告，貨幣種類，付款方式，價格，限額並寫出交易條款。";
	$translations['M01323']['Malay'] = "Anda perlu memilih untuk membeli atau menjual iklan, mata wang, kaedah pembayaran, harga, had dan menulis istilah perdagangan.";
	$translations['M01323']['Indonesia'] = "Anda harus memilih membeli atau menjual iklan, mata uang, metode pembayaran, harga, batasan dan menulis ketentuan perdagangan.";
	$translations['M01323']['Japanese'] = "売買広告、通貨、支払い方法、価格、制限を選択し、取引条件を書く必要があります。";
	$translations['M01323']['Korean'] = "광고를 팔거나 살때 쓰는 비용 지불 방법은 이용약관이 있습니다";
	$translations['M01323']['Spanish'] = "Debe elegir comprar o vender un anuncio, moneda, método de pago, precio, límites y escribir los términos de la operación.";
	$translations['M01323']['Portuguese'] = "Você precisa escolher um anúncio de compra ou venda, moeda, método e pagamento, limites e escrever os termos de negociação.";
	$translations['M01323']['Thai'] = "คุณจำเป็นต้องเลือกที่จะซื้อ หรือขายโฆษณา สกุลเงิน วิธีการชำระเงิน ราคา ลิมิต และเขียนเงื่อนไขในการเทรด";
	$translations['M01323']['Filipino'] = "Kailangan mong pumili ng bumibili o nagbebenta na patalastas, salapi, paraan ng pagbabayad, presyo, mga limitasyon at sumulat ng isang term ng kalakalan.";

	$translations['M01324']['english'] = "You need to have TheNux wallet, you must transfer fund to your TheNux wallet if you want to create a sell advertisement. All cryptocurrency you buy from xChange will go to your TheNux wallet.";
	$translations['M01324']['chineseSimplified'] = "您必须拥有TheNux钱包，如果您想创建销售广告，您必须将想要交易资金转移到您的TheNux钱包。 您从xChange购买的所有加密货币都将转到您的TheNux钱包。";
	$translations['M01324']['chineseTraditional'] = "您必須擁有TheNux錢包，如果您想創建銷售廣告，您必須將想要交易資金轉移到您的TheNux錢包。您從xChange購買的所有加密貨幣都將轉到您的TheNux錢包。";
	$translations['M01324']['Malay'] = "Anda perlu mempunyai dompet TheNux, anda mesti memindahkan dana ke dompet TheNux anda jika anda ingin membuat iklan penjualan. Semua cryptocurrency yang anda beli dari xChange akan masuk ke dompet TheNux anda.";
	$translations['M01324']['Indonesia'] = "Anda harus memiliki dompet TheNux, anda harus mentransfer dana ke dompet TheNux anda jika anda ingin membuat iklan penjualan. Semua cryptocurrency yang anda beli dari xChange akan masuk ke dompet TheNux Anda.";
	$translations['M01324']['Japanese'] = "TheNuxウォレットが必要です。販売広告を作成する場合は、資金をTheNuxウォレットに転送する必要があります。 xChangeから購入するすべての仮想通貨は、TheNuxウォレットに送られます。";
	$translations['M01324']['Korean'] = "TheNux 지갑은 광고를 팔때 필요합니다. 모든 크립토커런시를 구매할때는 TheNux 지갑이 필요합니다.";
	$translations['M01324']['Spanish'] = "Debe tener la billetera TheNux, debe transferir fondos a su billetera TheNux si desea crear un anuncio de venta. Todas las criptomonedas que compre en xChange irán a su billetera TheNux.";
	$translations['M01324']['Portuguese'] = "Você precisa ter a carteira TheNux, você deve transferir os fundos para a sua carteira TheNux se você quiser criar um anúncio de venda, Todas as criptomoedas que você comprar pelo xChange irão para a sua carteira TheNux.";
	$translations['M01324']['Thai'] = "คุณจำเป็นต้องมี Wallet ของ TheNux คุณต้องโอนเงินของคุณเข้ามายัง TheNux Wallet ถ้าหากคุณต้องการสร้างโฆษณาขาย ทุกสกุลเงินคริปโตที่คุณซื้อจาก xChaange จะถูกส่งไปยัง TheNux Wallet ของคุณ";
	$translations['M01324']['Filipino'] = "Kailangan mong magkaroon ng wallet na TheNux, dapat kang maglipat ng pondo sa iyong wallet na TheNux kung nais mong lumikha ng isang patalastas na nagbebenta. Ang lahat ng mga cryptocurrency na binili mo mula sa xChange ay pupunta sa iyong wallet na TheNux.";

