	$translations['M01327']['english'] = "Choose which currency you’re selling or buying. For instance, if you’re selling Bitcoin, you should select Bitcoin.";
	$translations['M01327']['chineseSimplified'] = "选择您销售或购买哪种货币。举例来说，如果您卖的比特币，您应该选择Bitcoin。";
	$translations['M01327']['chineseTraditional'] = "選擇您銷售或購買哪種貨幣。舉例來說，如果您賣的比特幣，您應該選擇Bitcoin。";
