	$translations['M01329']['english'] = "Choose which currency you're selling for or buying with. For instance, if you're selling in Malaysia you should select MYR.";
	$translations['M01329']['chineseSimplified'] = "选择您卖的或买哪种货币。举例来说，如果您在马来西亚销售，您应该选择MYR。";
	$translations['M01329']['chineseTraditional'] = "選擇您賣的或買哪種貨幣。舉例來說，如果您在馬來西亞銷售，您應該選擇MYR。";
	$translations['M01329']['Malay'] = "Pilih mata wang yang anda akan jual atau beli. Sebagai contoh, jika anda menjual di Malaysia, anda harus memilih MYR.";
