	$translations['M01331']['english'] = "Set a fix price to buy or sell so your advertisement price will not change as the market fluctuates.";
	$translations['M01331']['chineseSimplified'] = "设置固定价格买入或卖出，这样您的广告价格就不会随着市场波动而改变。";
	$translations['M01331']['chineseTraditional'] = "設置固定價格買入或賣出，這樣您的廣告價格就不會隨著市場波動而改變。";
	$translations['M01331']['Malay'] = "Tetapkan harga yang tetap untuk membeli atau menjual anda supaya harga iklan anda tidak akan berubah apabila harga pasaran turun naik.";
	$translations['M01331']['Indonesia'] = "Tetapkan harga yang tetap untuk membeli atau menjual sehingga harga iklan anda tidak akan berubah saat pasar berfluktuasi.";
	$translations['M01331']['Japanese'] = "市場が変動しても広告価格が変わらないように、買いまたは売りの固定価格を設定します。";
	$translations['M01331']['Korean'] = "고정된 가격을 정해서 광고 가격이 시세에 변경되지 않게 하세요";
	$translations['M01331']['Spanish'] = "Establezca un precio fijo para comprar o vender para que su precio de publicidad no cambie a medida que fluctúa el mercado.";
	$translations['M01331']['Portuguese'] = "Defina um preço fixo parar comprar ou vender, para que o preço do seu anúncio não mude conforme o mercado flutua.";
	$translations['M01331']['Thai'] = "กำหนดราคาในการซื้อ หรือขายเพื่อที่ราคาของโฆษณาคุณจะไม่เปลี่ยนแปลงตามตลาด";
	$translations['M01331']['Filipino'] = "Magtakda ng isang presyo sa pagbili o pagbenta upang ang iyong presyo ng patalastas ay hindi magbabago habang nagbabago ang merkado.";

