	$translations['M01333']['english'] = "The easy way to price your advertisement is to enter a ratio you want above the cryptocurrency market price. To do that, enter or choose a percentage in the floating ratio field.";
	$translations['M01333']['chineseSimplified'] = "为广告定价的最简单方法是在加密货币市场价格之上输入您想要的比率。 您可以在在浮动比率字段中输入或选择您想要的百分比。";
	$translations['M01333']['chineseTraditional'] = "為廣告定價的最簡單方法是在加密貨幣市場價格之上輸入您想要的比率。您可以在在浮動比率字段中輸入或選擇您想要的百分比。";
	$translations['M01333']['Malay'] = "Cara mudah untuk menetapkan harga iklan anda adalah dengan memasukkan nisbah yang anda inginkan di atas harga pasaran cryptocurrency. Untuk melakukannya, masukkan atau pilih peratusan dalam medan nisbah terapung.";
	$translations['M01333']['Indonesia'] = "Cara mudah untuk menetapkan harga iklan anda adalah dengan memasukkan rasio yang anda inginkan di atas harga pasar cryptocurrency. Untuk melakukannya, masukkan atau pilih persentase di bidang rasio mengambang.";
	$translations['M01333']['Japanese'] = "広告の価格を設定する簡単な方法は、仮想通貨の市場価格よりも高い比率を入力することです。そのためには、変動比率フィールドにパーセンテージを入力または選択します。";
	$translations['M01333']['Korean'] = "쉽게 가격을 광고하는 것은 크립토커런시 마켓 비율을 쓰는 것입니다. 또는 퍼센테지를 쓰는것입니다.";
	$translations['M01333']['Spanish'] = "La manera fácil de fijar el precio de su anuncio es ingresar un rango por encima del precio de mercado de la criptomoneda. Para hacer eso, ingrese o elija un porcentaje en el campo de relación flotante.";
	$translations['M01333']['Portuguese'] = "A maneira fácil de precificar o seu anúncio é inserir a taxa que você quer acima do preço de mercado de criptomoedas. Para fazer isso, insira ou escolha uma porcentagem no campo de taxa de flutuação.";
	$translations['M01333']['Thai'] = "วิธีที่ง่ายที่สุดในการลงราคาสำหรับโฆษณาของคุณคือการกรอกอัตราส่วนที่คุณต้องการให้มากกว่าราคาของสกุลเงินคริปโตในตลาด เพื่อที่จะทำแบบนั้น กรอก หรือเลือกเปอร์เซ็นต์ในช่องอัตราลอยตัว";
	$translations['M01333']['Filipino'] = "Ang madaling paraan upang lagyan ng presyo ang iyong patalastas ay ang itala ang isang ratio na nais mo na mataas sa presyo ng cryptocurrency sa merkado. Upang gawin iyon, itala o pumili ng isang porsyento sa patlang ng floating ratio.";

