	$translations['M01337']['english'] = "Select the payment method you want to offer. You can pre-set your payment method in your account setting. Your payment detail such as account name, account number only can see by people who place order at your advertisement.";
	$translations['M01337']['chineseSimplified'] = "选择您要提供的付款或收款方式。您可以预先设定在帐户中设定的付款或收款方式, 包括您的付款细节, 如账户名称，账号。这些信息只有下订单的用户能看见。";
	$translations['M01337']['chineseTraditional'] = "選擇您要提供的付款或收款方式。您可以預先設定在帳戶中設定的付款或收款方式, 包括您的付款細節, 如賬戶名稱，賬號。這些信息只有下訂單的用戶能看見。";
	$translations['M01337']['Malay'] = "Pilih kaedah pembayaran yang anda ingin tawarkan. Anda boleh mempratetapkan kaedah pembayaran anda dalam tetapan akaun anda. Butiran pembayaran anda seperti nama akaun, nombor akaun hanya dapat dilihat oleh orang yang membuat pesanan di iklan anda.";
	$translations['M01337']['Indonesia'] = "Pilih metode pembayaran yang ingin anda tawarkan. Anda dapat mengatur metode pembayaran anda dalam pengaturan akun Anda. Detail pembayaran anda seperti nama akun, nomor akun hanya dapat dilihat oleh orang yang melakukan pemesanan di iklan anda.";
	$translations['M01337']['Japanese'] = "提供する支払い方法を選択します。アカウント設定でお支払い方法を事前に設定できます。アカウント名、アカウント番号などの支払いの詳細は、広告を注文した人だけが見ることができます。";
	$translations['M01337']['Korean'] = "당신이 원하는 비용 지불 방법을 선택하세요. 계정 설정에서 비용 지불 방법을 설정할수 있습니다. 비용 지불에는 이름, 계좌 번호, 등이 구매자에게 보입니다.";
	$translations['M01337']['Spanish'] = "Seleccione el método de pago que desea ofrecer. Puede preestablecer su método de pago en la configuración de su cuenta. Los detalles de su pago, como el nombre de la cuenta y el número de cuenta, solo pueden verlos las personas que realizan pedidos en su anuncio.";
	$translations['M01337']['Portuguese'] = "Selecione o método de pagamento que você quer oferecer. Você pode predefinir o seu método de pagamento na sua configuração de conta. Os detalhes do seu pagamento, como o nome da conta e o número da conta, só podem ser vistos por pessoas que fizerem pedidos no seu anúncio.";
	$translations['M01337']['Thai'] = "เลือกวิธีการชำระเงินที่คุณต้องการ คุณสามารถตั้งค่าวิธีการชำระเงินของคุณเอาไว้ล่วงหน้าได้ในการตั้งค่าบัญชี ข้อมูลการชำระเงินของคุณ เช่น ชื่อบัญชี เลขที่บัญชี จะมีเพียงผู้ที่วางออเดอร์ใยโฆษณาของคุณเท่านั้นที่มองเห็น";
	$translations['M01337']['Filipino'] = "Piliin ang paraan ng pagbabayad na nais mong i-alok. Maaari mong i-pre-set ang iyong paraan ng pagbabayad sa setting ng iyong account. Ang iyong detalye ng pagbabayad tulad ng pangalan ng account, numero ng account ay maaari lamang makita ng mga taong naglalagay ng order sa iyong patalastas.";

