	$translations['M01338']['Spanish'] = "Límite mínimo/máximo de transacción";
	$translations['M01338']['Portuguese'] = "Limite Min/Max de transação";
	$translations['M01338']['Thai'] = "ลิมิตการทำธุรกรรมต่ำสุด/สูงสุด";
	$translations['M01338']['Filipino'] = "Pinakamababa/Pinakamataas na limitasyon ng transaksyon";

	$translations['M01339']['english'] = "The minimum transaction limit sets the smallest amount someone can buy. If you set it to five, and you have your currency set to USD it means that smallest trade someone can open with you will be for 5 USD. The maximum transaction limit sets what the biggest trade that you want to accept.";
	$translations['M01339']['chineseSimplified'] = "最低交易限额设定了可以购买的最小金额。 如果您将其设置为5，并且您的货币设置为美元，则意味着有人可以与您开立的最小交易将为5美元。 最高交易限额设定了您想要接受的最大交易量，即您想要买入或卖出的金额。";
	$translations['M01339']['chineseTraditional'] = "最低交易限額設定了可以購買的最小金額。如果您將其設置為5，並且您的貨幣設置為美元，則意味著有人可以與您開立的最小交易將為5美元。最高交易限額設定了您想要接受的最大交易量，即您想要買入或賣出的金額。";
	$translations['M01339']['Malay'] = "Had transaksi minimum menetapkan jumlah terkecil yang boleh dibeli. Jika anda menetapkannya kepada lima, dan anda mempunyai set mata wang anda kepada USD ia bermakna perdagangan seseorang terkecil boleh dibuka dengan anda akan menjadi 5 USD. Had transaksi maksima menetapkan perdagangan yang paling besar yang anda mahu menerima dan amaun yang anda ingin beli atau menjual.";
	$translations['M01339']['Indonesia'] = "Batas transaksi minimum menetapkan jumlah terkecil yang boleh dibeli seseorang. Jika Anda menetapkannya menjadi lima, dan mata uang anda diatur ke USD, itu berarti perdagangan terkecil yang dapat dibuka seseorang dengan anda adalah 5 USD. Batas transaksi maksimum menentukan apa perdagangan terbesar yang anda ingin terima dan jumlah yang ingin anda beli atau jual.";
	$translations['M01339']['Japanese'] = "最小取引限度は、誰かが購入できる最小額を設定します。 5に設定し、通貨をUSDに設定している場合、誰かがお客様とオープンできる最小の取引は5 USDになります。最大取引制限は、受け入れたい最大の取引を設定します。";
	$translations['M01339']['Korean'] = "한 사람이 살수 있는 최저 송금은 정해저 있습니다. 당신이 5로 설정해 둔다면, 그 뜻은 5달러가 가장 작은 교환인것 입니다. 최대는 당신이 원하는 대로 선택할수 있습니다.";
	$translations['M01339']['Spanish'] = "El mínimo de transacción establece la cantidad más pequeña que alguien puede comprar. Si lo establece en cinco, y tiene su moneda establecida en USD, significa que la operación más pequeña que alguien puede abrir con usted será de 5 USD. El límite máximo de transacción establece cuál es la operación más grande que desea aceptar.";
	$translations['M01339']['Portuguese'] = "O limite mínimo de transação define a menor quantia que alguém pode comprar. Se você defini-lo em cinco, e você tiver a sua moeda definida como USD, isso significa que a menor negociação que alguém pode abrir com você será por 5USD. O limite máximo de transação define a maior quantia de negociação que você quer aceitar.";
	$translations['M01339']['Thai'] = "ลิมิตการทำธุรกรรมต่ำสุดเป็นการตั้งค่าที่น้อยที่สุดที่สามารถซื้อได้ ถ้าหากคุณตั้งค่าเป็น 5 และคุณตั้งค่าสกุลเงินเป็น USD นั่นหมายความค่าที่ต่ำที่สุดที่จะสามารถเทรดกับคุณได้คือ 5 USD ลิมิตที่สูงสุดที่สุดตั้งค่าการเทรดที่สูงที่สุดที่คุณอยากจะรับ";
	$translations['M01339']['Filipino'] = "Ang pinakamababang limitasyon ng transaksyon ay nagtatakda ng pinakamaliit na halaga na maaaring bilhin ng isang tao. Kung itinakda mo ito sa lima, at itinakda mo ang iyong pera sa USD nangangahulugan ito na ang pinakamaliit na kalakalan na maaaring buksan ng isang tao sa iyo ay para sa 5 USD. Ang pinakamataas na limitasyon ng transaksyon ay nagtatakda kung ano ang pinakamalaking kalakalan ang nais mong tanggapin.";

	$translations['M01340']['english'] = "Maximum Processing Orders";
