	$translations['M01340']['Filipino'] = "Pinakamataas na bilang ng Pagpoproseso ng mga Order";

	$translations['M01341']['english'] = "This can help you to avoid many orders coming in at the same time, resulting in a situation that cannot be dealt with. For instance, when you set it to 2, only two orders will be placed at the same time, and the next order will be allowed after you have finished processing.";
	$translations['M01341']['chineseSimplified'] = "设置该限制，您可以避免大量订单同时涌进，导致处理不过来的情况。比如当您设置为2时，最多只会有两笔订单同时向您下单，待您处理完毕后才允许下一个订单进入。";
	$translations['M01341']['chineseTraditional'] = "設置該限制，您可以避免大量訂單同時湧進，導致處理不過來的情況。比如當您設置為2時，最多只會有兩筆訂單同時向您下單，待您處理完畢後才允許下一個訂單進入。";
	$translations['M01341']['Malay'] = "Ini dapat membantu anda untuk mengelakkan  pesanan yang banyak masuk pada masa yang sama, yang diaman ianya mengakibatkan situasi yang tidak dapat ditangani. Sebagai contoh, apabila anda menetapkannya kepada 2, hanya 2 pesanan akan diletakkan pada masa yang sama, dan pesanan seterusnya akan dibenarkan selepas anda selesai memproseskannya.";
	$translations['M01341']['Indonesia'] = "Ini dapat membantu anda menghindari pesanan yang banyak datang pada saat yang sama, dimana itu menghasilkan situasi yang tidak dapat ditangani. Misalnya, ketika anda menetapkannya kepada 2, hanya 2 pesanan akan ditempatkan pada waktu yang sama, dan pesanan berikutnya akan diizinkan setelah anda selesai memprosesnya.";
	$translations['M01341']['Japanese'] = "これにより、同時に多くの注文が入るのを回避でき、対処できない状況になります。たとえば、2に設定すると、同時に2つの注文のみが行われ、処理が完了した後、次の注文が許可されます。";
	$translations['M01341']['Korean'] = "이것은 많은 주문을 받는 것을 방지위해서 입니다. 예를 들어서 두 사람이 동시에 같이 주문을 한다면 첫번째게 먼저 되거 두번째게 나중에 됩니다.";
	$translations['M01341']['Spanish'] = "Esto puede ayudarlo a evitar que lleguen muchos pedidos al mismo tiempo, lo que resulta en una situación que no se puede resolver. Por ejemplo, cuando lo establece en 2, solo se realizarán dos pedidos al mismo tiempo, y el siguiente pedido se permitirá una vez que haya finalizado el procesamiento.";
	$translations['M01341']['Portuguese'] = "Isso pode ajudar você a evitar muitos pedidos chegando ao mesmo tempo, resultando numa situação que não pode ser controlada. Por exemplo, quando você o define em 2, apenas 2 pedidos serão feitos ao mesmo tempo, e o próximo pedido só será permitido depois que você tiver terminado o processamento.";
	$translations['M01341']['Thai'] = "นี่จะช่วยให้คุณสามารถหลีกเลี่ยงออเดอร์หลายออเดอร์ที่เข้ามาในเวลาเดียวกันได้ ที่อาจจะทำให้เกิดสถานการณ์ที่ไม่สามารถต่อรองได้ ยกตัวอย่างเช่น หากคุณตั้งค่าเป็น 2 มีเพียง 2 ออเดอร์เท่านั้นที่จะถูกวางพร้อมกันได้ และออเดอร์ถัดไปจะสามารถอนุญาตให้วางได้หลังจากที่คุณดำเนินการเสร็จแล้ว";
	$translations['M01341']['Filipino'] = "Makakatulong ito sa iyo upang maiwasan ang maraming mga order na pumapasok nang sabay, na nagreresulta sa isang sitwasyong hindi kayang harapin. Halimbawa, kapag itinakda mo ito sa 2, dalawang mga order lamang ang mailalagay nang sabay, at ang susunod na order ay papayagan lamang pagkatapos mong makumpleto ang pagproseso.";

