	$translations['M01343']['english'] = "Info can see by everyone at your advertisement. You can tell the people what they need to know before placing an order at info section.";
	$translations['M01343']['chineseSimplified'] = "每个人都可以在广告中看到信息。您可以通过信息告诉人们他们在下订单之前需要知道什么。";
	$translations['M01343']['chineseTraditional'] = "每個人都可以在廣告中看到信息。您可以通過信息告訴人們他們在下訂單之前需要知道什麼。";
	$translations['M01343']['Malay'] = "Maklumat boleh dilihat oleh semua orang pada iklan anda. Anda boleh memberitahu apa yang perlu mereka ketahui sebelum membuat pesanan di bahagian maklumat.";
	$translations['M01343']['Indonesia'] = "Info akan dapat dilihat oleh semua orang di iklan anda. Anda dapat memberi tahu  apa yang perlu  diketahui mereka sebelum melakukan pemesanan di bagian info.";
	$translations['M01343']['Japanese'] = "情報は、広告の全員が見ることができます。情報セクションで注文する前に、知っておくべきことを人々に伝えることができます。";
	$translations['M01343']['Korean'] = "모든사람이 당신의 광고를 볼수 있습니다. 당신은 사람들에게 알아야 하는것을 주문하기 전에 있는 섹션에 입력할수 있습니다.";
	$translations['M01343']['Spanish'] = "La información puede ser vista por todos en su anuncio. Puede decirle a las personas lo que necesitan saber antes de realizar un pedido en la sección de información.";
	$translations['M01343']['Portuguese'] = "As informações podem ser vistas por todos no seu anúncio. Você pode contar às pessoas o que elas precisam saber antes de fazer um pedido na seção informações.";
	$translations['M01343']['Thai'] = "ข้อมูลสามารถมองเห็นได้ทุกคนที่เข้ามาดูโฆษณาของคุณ คุณสามารถบอกทุกสิ่งที่พวกเขาจำเป็นจ้องรู้ก่อนวางออเดอร์ได้ที่ส่วนของข้อมูล";
	$translations['M01343']['Filipino'] = "Ang impormasyon ay makikita ng lahat sa iyong patalastas. Maaari mong sabihin sa mga tao kung ano ang kailangan nilang malaman bago maglagay ng isang order sa seksyon ng impormasyon.";

