	$translations['M01345']['english'] = "Only placed order user can see your advertisement remarks section. You can put your contact detail in this section, so when someone place order at your advertisement, they will contact you.";
	$translations['M01345']['chineseSimplified'] = "只有已下订单的用户才能看到您的广告备注。 您可以在此部分中显示您的联系方式，因此当有人在您的广告上下订单时，他们会与您联系。";
	$translations['M01345']['chineseTraditional'] = "只有已下訂單的用戶才能看到您的廣告備註。您可以在此部分中顯示您的聯繫方式，因此當有人在您的廣告上下訂單時，他們會與您聯繫。";
	$translations['M01345']['Malay'] = "Hanya pengguna yang telah pesanan yang dapat melihat bahagian ucapan iklan anda. Anda boleh memasukkan butiran hubungan anda dalam bahagian ini,  supaya apabila seseorang membuat pesanan di iklan anda, mereka dapat menghubungi anda.";
	$translations['M01345']['Indonesia'] = "Hanya pengguna yang telah memesan dapat melihat bagian komentar iklan anda. Anda dapat memasukkan detail kontak anda di bagian ini, jadi ketika seseorang memesan di iklan anda, mereka akan menghubungi anda.";
	$translations['M01345']['Japanese'] = "発注されたユーザーのみが広告の備考セクションを見ることができます。このセクションに連絡先の詳細を入力して、誰かが広告を注文したときに連絡するようにすることができます。";
	$translations['M01345']['Korean'] = "주문을 한 유저만 광고 리마크를 볼수 있습니다. 그 섹션에는 연락처를 넣어서 주문을 한 사람과 연락을 할수 있습니다.";
	$translations['M01345']['Spanish'] = "Solo el usuario del pedido realizado puede ver la sección de comentarios de su anuncio. Puede poner sus datos de contacto en esta sección, de modo que cuando alguien haga un pedido en su anuncio, se pondrán en contacto con usted.";
	$translations['M01345']['Portuguese'] = "Apenas os usuários que fizeram pedidos podem ver a seção observações do seu anúncio. Você pode colocar seus detalhes de contato nesta seção, então quando alguém fizer um pedido no seu anúncio, ele irá entrar em contato com você.";
	$translations['M01345']['Thai'] = "มีเพียงแค่เทรดเดอร์ที่วางออเดอร์กับคุณแล้วเท่านั้นจึงจะเห็นส่วนหมายเหตุของโฆษณาของคุณ คุณสามารถใส่ข้อมูลการติดต่อของคุณได้ในส่วนนี้ เพื่อคนที่วางออเดอร์กับโฆษณาของคุณจะได้ติดต่อคุณได้";
	$translations['M01345']['Filipino'] = "Tanging mga gumagamit na nag-order ang maaaring makakita ng seksyon ng mga puna ng iyong patalastas. Maaari mong ilagay ang detalye ng iyong contact sa seksyong ito, kaya kapag ang isang tao ay mag-order ng iyong patalastas, makikipag-ugnay sila sa iyo.";

