	$translations['M01350']['Indonesia'] = "Jika ada perbedaan pendapat dalam perdagangan, anda boleh membuat laporan ke TheNux. misalnya dalam hal pembeli telah menekan tombol saya telah membayar beberapa kali, tetapi gagal untuk memberikan bukti dan anda tidak menerima dana dari pembeli maka Aanda boleh membuat laporan dengan menekan tombol laporan.";
	$translations['M01350']['Japanese'] = "取引に不一致がある場合は、TheNuxに報告することができます。例えばバイヤーが私が数回支払いましたが、証拠を提供できず、バイヤーから資金を受け取っていない場合、レポートボタンを押してレポートを作成できます。";
	$translations['M01350']['Korean'] = "교환에 차질이 있다면 신고를 TheNux에 하세요. 예를 들어서 비용을 지불 했다고 하는데 돈이 않들어 왔다면 신고를 하세요.";
