	$translations['M01350']['Thai'] = "ถ้าหากมีความขัดแย้งในการเทรด คุณสามารถรายงานมาที่ TheNux ได้ เช่น ในกรณีที่ผู้ซื้อกด ฉันจ่ายเงินแล้ว หลายครั้ง แต่ไม่สามารถส่งหลักฐานที่ยืนยัน และคุณเองก็ยังไม่ได้รับเงินจากผู้ซื้อ คุณสามารถรายงานได้โดยกดปุ่ม รายงาน";
