	$translations['M01359']['Malay'] = "Yuran komisyen akan dihantar secara langsung dalam masa nyata ke dompet TheNux anda saat pengadil anda yang telah menyelesaikan setiap perdagangan dan akan dibayar kepada anda dalam apa-apa token/cryptocurrency berdasarkan pembayaran yuran asal.";
