	$translations['M01359']['Spanish'] = "La comisión de la tarifa se enviará instantáneamente en tiempo real a su billetera TheNux a medida que su árbitro complete cada transacción y se le pagará en cualquier token / criptomoneda en la que se pagó la tarifa original.";
	$translations['M01359']['Portuguese'] = "A comissão pela taxa será enviada instantaneamente em tempo real para a sua carteira TheNux conforme sua indicação completa cada negociação, e será paga a você em seja qual for o token/criptomoeda com o qual a taxa original foi paga.";
	$translations['M01359']['Thai'] = "ค่าธรรมเนียมคอมมิชชั่นจะถูกส่งไปแบบเรียลไทม์ไปยัง TheNux Wallet เมื่อผู้ที่ได้รับการแนะนำได้ทำการเทรดเสร็จสมบูรณ์ในแต่ละครั้ง และจะถูกจ่ายให้คุณในรูปของโทเคน/สกุลเงินคริปโตตามค่าธรรมเนียมเดิม";
