	$translations['M01362']['english'] = "Share your QR Code to social media, new joiner will entitle for a lucky draw, chances to get up to 1,000 USD value of BTC. You will get 50% of the total amount as commission too!";
	$translations['M01362']['chineseSimplified'] = "分享您的QR码社交媒体，新加入者将有权对抽奖，有机会获得高达1,000美元价值的BTC。您将获得总金额的50%作为佣金呢！";
	$translations['M01362']['chineseTraditional'] = "分享您的QR碼社交媒體，新加入者將有權對抽獎，有機會獲得高達1,000美元價值的BTC。您將獲得總金額的50%作為佣金呢！";
	$translations['M01362']['Malay'] = "Kongsikan Kod QR anda ke laman media sosial, peserta yang baru akan diberi dan berhak untuk cabutan  bertuah dan bereluang untuk mendapatkan sehingga 1,000 USD nilai BTC. Anda akan mendapat 50% dari jumlah keseluruhan sebagai komisyen juga!";
	$translations['M01362']['Indonesia'] = "Bagikan QR Code anda ke laman media sosial, joiner yang baru akan berhak mendapatkan lucky draw dan berpeluang mendapatkan nilai BTC hingga 1.000 USD. Anda akan mendapatkan 50% dari jumlah total sebagai komisi juga!";
	$translations['M01362']['Japanese'] = "QRコードをソーシャルメディアで共有すると、新しい参加者にラッキー抽選の資格が与えられ、最大1,000 USDのBTCの価値を得ることができます。合計金額の50％もコミッションとして受け取ります！";
	$translations['M01362']['Korean'] = "규얼 코드를 공유해서 새로운 유저가 합류하면 럭키 뽑기를 받습니다. 많게는 1,000 달라까지 BTC로 받을수 있는 운이 있습니다. 또 50% 수수료를 받을수 있습니다.";
	$translations['M01362']['Spanish'] = "Comparta su código QR en las redes sociales, el nuevo miembro tendrá derecho a un sorteo, posibilidades de obtener un valor de BTC de hasta 1,000 USD. ¡Usted obtendrá el 50% del monto total como comisión también!";
	$translations['M01362']['Portuguese'] = "Compartilhe o seu QR Code nas redes sociais, os novos membros terão direito a um sorteio com chances de ganhar até 1.000USD em BTC. Você receberá 50% da quantia total como comissão também!";
	$translations['M01362']['Thai'] = "แชร์ QR code ของคุณไปยัง Social Media ผู้เข้าร่วมใหม่จะได้รับการสุ่มผู้โชคดีเพื่อรับโอกาสที่จะได้รับมากถึง BTC มูลค่า 1,000 USD และคุณจะได้รับ 50% จากจำนวนเงินทั้งหมดเป็นค่าคอมมิชชั่นด้วยเช่นกัน!";
	$translations['M01362']['Filipino'] = "Ibahagi ang iyong QR Code sa social media, ang mga bagong sumali ay bibigyan ng karapatan sa isang masuwerteng draw, may posibilidad na makakuha ng hanggang sa 1,000 USD na halaga ng BTC. Makakakuha ka ng 50% ng kabuuang halaga bilang komisyon din!";

	$translations['M01363']['english'] = "TheNux will check for duplicate or fake accounts and will not pay out referral bonuses on these accounts. Duplicate or shared finances will result in disqualification.";
	$translations['M01363']['chineseSimplified'] = "TheNux将检查重复或虚假账户，并且不会支付这些账户的推荐奖金。 重复或虚假账号会导致您失去参加资格。";
	$translations['M01363']['chineseTraditional'] = "TheNux將檢查重複或虛假賬戶，並且不會支付這些賬戶的推薦獎金。重複或虛假賬號會導致您失去參加資格。";
	$translations['M01363']['Malay'] = "TheNux akan menyemak akaun duplikat atau palsu dan tidak akan membayar bonus rujukan pada akaun-akaun ini. Duplikat atau kewangan yang dikongsi akan mengakibatkan kehilangan kelayakan.";
	$translations['M01363']['Indonesia'] = "TheNux akan memeriksa duplikat atau akun palsu dan tidak akan membayar bonus rujukan pada akun ini. Duplikat atau keuangan bersama akan menghasilkan diskualifikasi.";
	$translations['M01363']['Japanese'] = "TheNuxは、重複または偽のアカウントを確認し、これらのアカウントの紹介ボーナスを支払いません。重複または共有の財政は失格となります。";
	$translations['M01363']['Korean'] = "TheNux는 가짜 계정을 찾아냅니다. 이것은 영정을 받을 수 있습니다.";
	$translations['M01363']['Spanish'] = "TheNux verificará cuentas duplicadas o falsas y no pagará bonos de referencia en estas cuentas. Las finanzas duplicadas o compartidas resultarán en la descalificación.";
