	$translations['M01363']['Thai'] = "TheNux จะตรวจสอบสำหรับบัญชีที่ทำซื้อ หรือปลอมขึ้นมา และจะไม่จ่ายโบนัสสำหรับการอ้างอิงให้กับบัญชีเหล่านี้ การทำซ้ำ หรือใช้ร่วมกันจะทำให้ถูกตัดสิทธิ์";
	$translations['M01363']['Filipino'] = "Magsusuri ang TheNux ng mga doble o pekeng account at hindi magbabayad ng mga bonus ng referral sa mga account na ito. Ang doble o ibinahaging pananalapi ay magreresulta sa diskwalipikasyon.";

