	$translations['M01365']['Korean'] = "TheNux는 모든 것에 대해서 권한이 있습니다. 추천 프로그램을 언제든지 바꿀수 있는 권한이 있습니다.";
	$translations['M01365']['Spanish'] = "TheNux se reserva el derecho de cambiar los términos del programa de referencia en cualquier momento debido a las condiciones cambiantes del mercado, el riesgo de fraude o cualquier otro factor que consideremos relevante.";
	$translations['M01365']['Portuguese'] = "O TheNux se reserva o direito de mudar os termos do programa de indicações a qualquer momento devido a alterações nas condições do mercado, risco de fraude, ou quaisquer outros fatores que julguemos relevante.";
	$translations['M01365']['Thai'] = "TheNux มีสิทธิที่จะเปลี่ยนแปลงข้อกำหนดของโปรแกรมอ้างอิงเมื่อใดก็ได้ตามเงื่อนไขการเปลี่ยนแลปงของตลาด ความเสี่ยงในการทุจริต หรือปัจจัยอื่น ๆ ที่เราเห็นว่าเกี่ยวข้อง";
	$translations['M01365']['Filipino'] = "Ang TheNux ay may karapatang baguhin ang mga term ng programa ng referral anumang oras dahil sa mga  pabago-bagong kondisyon ng merkado, panganib ng pandaraya, o anumang iba pang mga kadahilanan na ipinapalagay naming nauugnay.";

