	$translations['M01368']['english'] = "Cryptocurrency is the game changer of finance in future. The number of individual and corporate parties adapting to asset management via digital currency is steadily growing. We seized this opportunity; to create the safest cryptocurrency wallet in the world for you. TheNux wallet gives you the key to unlock (and lock) your own financial empowerment. Quite literally";
	$translations['M01368']['chineseSimplified'] = "加密货币是金融在未来的游戏规则的改变。来自个人和组织各方适应，通过数字货币资产管理的数量正在稳步增长。我们抓住了这个机会;创造世界上最安全加密货币钱包给您。 TheNux钱包给您开锁的钥匙（并锁定）自己的财务能力。";
	$translations['M01368']['chineseTraditional'] = "加密貨幣是金融在未來的遊戲規則的改變。來自個人和組織各方適應，通過數字貨幣資產管理的數量正在穩步增長。我們抓住了這個機會;創造世界上最安全加密貨幣錢包給您。 TheNux錢包給您開鎖的鑰匙（並鎖定）自己的財務能力。";
	$translations['M01368']['Malay'] = "Cryptocurrency adalah sebuah permainan yang memebawa perubahan terhadap kewangan pada masa akan datang. Bilangan penyesuaian parti individu dan korporat dengan pengurusan aset melalui mata wang digital terus berkembang. Kami mengambil peluang ini; untuk mencipta dompet cryptocurrency yang selamat di dunia untuk anda. Dompet TheNux  memberi anda kunci untuk membuka (dan mengunci) pemberdayaan kewangan anda sendiri. Sudah tentu.";
	$translations['M01368']['Indonesia'] = "Cryptocurrency adalah pengubah permainan keuangan di masa depan. Jumlah pihak individu dan perusahaan yang beradaptasi dengan manajemen aset melalui mata uang digital terus meningkat. Kami mengambil kesempatan ini; untuk membuat dompet cryptocurrency teraman di dunia untuk anda. Dompet TheNux memberi anda kunci untuk membuka (dan mengunci) pemberdayaan keuangan anda sendiri. Tentu saja.";
	$translations['M01368']['Japanese'] = "仮想通貨は、将来の金融のゲームチェンジャーです。デジタル通貨による資産管理に適応している個人および企業の数は着実に増加しています。この機会を捉えました。世界で最も安全な仮想通貨ウォレットを作成します。 TheNuxウォレットは、お客様自身の経済的エンパワーメントを解除（およびロック）するためのキーを提供します。まさしく文字通り";
	$translations['M01368']['Korean'] = "크립토커런시는 미래 자본의 게임 체인저입니다. 개인하고 회사들이 디지털 화폐 사용이 늘고 있습니다. 우리는 이 기회를 사용해서 세계에서 가장 안전한 크립토커런시를 만들것입니다. TheNux 지갑은 당신의 자본에 키를 드립니다.";
	$translations['M01368']['Spanish'] = "La criptomoneda cambiará el juego de las finanzas en el futuro. El número de partes individuales y corporativas que se adaptan a la gestión de activos a través de la moneda digital está creciendo constantemente. Aprovechamos esta oportunidad; para crear la billetera de criptomonedas más segura del mundo para ti. La billetera TheNux le brinda la clave para desbloquear (y bloquear) su propio empoderamiento financiero. Literalmente";
	$translations['M01368']['Portuguese'] = "Criptomoeda é o divisor de águas das finanças no futuro. O número de indivíduos e grupos corporativos se adaptando ao gerenciamento de ativos via moeda digital está aumentando constantemente. Nós agarramos a oportunidade: criar a carteira de criptomoeda mais segura do mundo para você. A careteira TheNux dá a você a chave para destrancar (e trancar) o seu próprio empoderamento financeiro. Bem literalmente";
	$translations['M01368']['Thai'] = "สกุลเงินคริปโตเป็นตัวเปลี่ยนแปลงโลกการเงินที่สำคัญมากในอนาคต จำนวนคน และองค์กรที่ปรับตัวมาใช้การจัดการสินทรัพย์ผ่านสกุลเงินดิจิทัลค่อย ๆ เพิ่มมากขึ้นเรื่อย ๆ เรามองเห็นโอกาสนี้ และสร้าง Waller สำหรับสกุลเงินคริปโตที่ปลอดภัยที่สุดในโลกให้กับคุณ TheNux wallet จะช่วยมอบกุญแจให้กับคุณในการไข (และล็อก) พลังอำนาจทางการเงินของคุณได้อย่างแท้จริง";
	$translations['M01368']['Filipino'] = "Ang cryptocurrency ay ang magpapabago ng pananalapi sa hinaharap. Ang bilang ng mga indibidwal at mga partidong pansama-sama na umaangkop sa pamamahala ng asset sa pamamagitan ng digital na pera ay patuloy na lumalago. Sinunggaban namin ang pagkakataong ito; upang lumikha ng pinakaligtas na wallet ng cryptocurrency sa mundo para sa iyo. Ang wallet na TheNux ay nagbibigay sa iyo ng susi upang i-unlock (at i-lock) ang iyong sariling pinansiyal na kapangyarihan. Medyo literal";

	$translations['M01369']['english'] = "We bring together the most remarkable talents in cryptocurrency, software development, fintech as well as user experience to work as a team. As the market for digital currency is constantly evolving, this puts us on the right track to continue delivering innovations to enhance users’ lifestyle.";
	$translations['M01369']['chineseSimplified'] = "我们汇集在加密货币，软件开发，fintech以及用户体验的最显着的人才作为一个团队工作。随着市场对电子货币在不断地发展，这让我们在正确的轨道上继续提供创新，以提高用户的生活方式。";
	$translations['M01369']['chineseTraditional'] = "我們匯集在加密貨幣，軟件開發，fintech以及用戶體驗的最顯著的人才作為一個團隊工作。隨著市場對電子貨幣在不斷地發展，這讓我們在正確的軌道上繼續提供創新，以提高用戶的生活方式。";
	$translations['M01369']['Malay'] = "Kami mengumpulkan individu yang berbakat luar biasa dalam cryptocurrency, pembangunan perisian, fintech serta pengalaman pengguna untuk bekerja sebagai satu pasukan. Memandangkan pasaran untuk mata wang digital sentiasa berubah, ini meletakkan kami di landasan yang betul untuk terus menyampaikan inovasi untuk meningkatkan gaya hidup pengguna.";
	$translations['M01369']['Indonesia'] = "Kami menyatukan talenta yang paling luar biasa dalam cryptocurrency, pengembangan perangkat lunak, fintech serta pengalaman pengguna untuk bekerja sebagai sebuah tim. Karena pasar untuk mata uang digital terus berkembang, ini menempatkan kami di jalur yang benar untuk terus memberikan inovasi untuk meningkatkan gaya hidup pengguna.";
	$translations['M01369']['Japanese'] = "我々は、仮想通貨、ソフトウェア開発、フィンテック、そしてユーザーエクスペリエンスで最も優れた才能を結集し、チームとして働きます。デジタル通貨の市場は絶えず進化しているため、ユーザーのライフスタイルを向上させるためのイノベーションを継続的に提供するための適切な道を歩むことができます。";
	$translations['M01369']['Korean'] = "모두의 대단한 능력을 크립토커런시를 마켓으로 데리고 옵니다. 크립토커런시, 소프트웨어 발달, 등 많은 능력이 있는 사용자를 팀으로 일을 합니다. 디지털 화폐 마켓이 커짐으로서 이것은 사용자를 맞는 삶으로 놓고 있습니다.";
	$translations['M01369']['Spanish'] = "Reunimos los talentos más notables en criptomoneda, desarrollo de software, tecnología financiera y experiencia del usuario para trabajar en equipo. A medida que el mercado de la moneda digital evoluciona constantemente, esto nos coloca en el camino correcto para continuar entregando innovaciones para mejorar el estilo de vida de los usuarios.";
	$translations['M01369']['Portuguese'] = "Nós trazemos conosco os talentos mais notáveis dos campos de criptomoedas, desenvolvimento de software, fintech e também experiência do usuário para trabalhar como um time. Como o mercado para as moedas digitais está evoluindo constantemente, isso nos coloca nos trilhos certos para continuar a entregar inovações para aprimorar o estilo de vida dos usuários.";
	$translations['M01369']['Thai'] = "เราได้ผสมผสานคุณสมบัติที่โดดเด่นที่สุดของสกุลเงินคริปโต การพัฒนาซอฟต์แวร์ ฟินเทค รวมไปถึงประสบการณ์ในการทำงานเป็นทีม เนื่องจากตลาดสำหรับสกุลเงินดิจิทัลนั้นค่อย ๆ เติบโตมากขึ้นทำให้เราสามารถส่งมอบนวัตรกรรมในการพัฒนาไลฟ์สไตล์ของผู้ใช้งานได้";
	$translations['M01369']['Filipino'] = "Pinagsama-sama namin ang pinaka kapansin-pansin na talento sa cryptocurrency, pagpapa-unlad ng software, fintech pati na rin ang karanasan ng gumagamit upang gumawa bilang isang grupo. Habang ang merkado para sa digital na pera ay patuloy na umuusbong, dinadala tayo nito sa tamang daan upang magpatuloy sa paghahatid ng mga pagbabago upang mapahusay ang pamumuhay ng mga gumagamit.";

