	$translations['M01371']['english'] = "Our mission is to create a top notch platform for digital asset management on a global level. We have TWO main focus: SECURITY and ACCESSIBILITY.";
	$translations['M01371']['chineseSimplified'] = "我们的使命是在全球范围内创造数字资产管理一个顶尖的平台。我们有两个重点：安全性和易用性。";
	$translations['M01371']['chineseTraditional'] = "我們的使命是在全球範圍內創造數字資產管理一個頂尖的平台。我們有兩個重點：安全性和易用性。";
	$translations['M01371']['Malay'] = "Misi kami adalah untuk mewujudkan platform kedudukan teratas untuk pengurusan aset digital pada tahap global. Kami mempunyai DUA fokus utama: SEKURITI DAN AKSESIBILITI.";
	$translations['M01371']['Indonesia'] = "Misi kami adalah menciptakan platform kedudukan tertinggi untuk manajemen aset digital di tingkat global. Kami memiliki DUA fokus utama: SEKURITI dan AKSESIBILITAS.";
	$translations['M01371']['Japanese'] = "我々の使命は、グローバルレベルでデジタル資産管理のための最高のプラットフォームを作成することです。セキュリティとアクセシビリティの2つの主な焦点があります。";
	$translations['M01371']['Korean'] = "저의 목표는 최고의 크리토커런시 앱이 되는 겁니다. 저희의 두개의 메인 집중: 보안과 접근성";
	$translations['M01371']['Spanish'] = "Nuestra misión es crear una plataforma de primer nivel para la gestión de activos digitales a nivel mundial. Tenemos DOS enfoques principales: SEGURIDAD y ACCESIBILIDAD.";
	$translations['M01371']['Portuguese'] = "Nossa missão é criar uma plataforma de ponta para gerenciamento de ativos digitais em nível global. Nós temos DOIS focos principais: SEGURANÇA e ACESSIBILIDADE.";
	$translations['M01371']['Thai'] = "ภารกิจของพวกเราคือการสร้างแพลตฟอร์มที่ดีที่สุดสำหรับการจัดการสินทรัพย์ดิจิทัลในระดับโลก เราต้องการโฟกัสเพียงแค่สองอย่างได้แก่ ความปลอดภัย และการเข้าถึง";
	$translations['M01371']['Filipino'] = "Ang aming misyon ay ang lumikha ng isang nangungunang platform ng para sa pamamahala ng pag-aaring digital sa isang global na antas. Mayroon kaming DALAWANG pangunahing pokus: SEGURIDAD at KAKAYAHANG MA-ACCESS.";

