	$translations['M01373']['english'] = "We do not compromise when it comes to the safety of TheNux wallet. Each and every little detail is meticulously researched, tested and developed to be included in the wallet to ensure absolutely no loopholes could manipulate users’ privacy.";
	$translations['M01373']['chineseSimplified'] = "当谈到TheNux钱包的安全性，我们不会妥协。每个小细节的精心研究，测试和开发被列入钱包，以确保绝对没有漏洞可以操纵用户的隐私。";
	$translations['M01373']['chineseTraditional'] = "當談到TheNux錢包的安全性，我們不會妥協。每個小細節的精心研究，測試和開發被列入錢包，以確保絕對沒有漏洞可以操縱用戶的隱私。";
	$translations['M01373']['Malay'] = "Kami tidak berkompromi apabila ianya berkaitan tentang sekuriti dompet TheNux. Setiap butiran  akan diteliti, diuji dan dibangunkan untuk dimasukkan ke dalam dompet untuk memastikan sama sekali tiada celah yang boleh memanipulasi privasi pengguna.";
	$translations['M01373']['Indonesia'] = "Kami tidak berkompromi dalam hal sekuriti dompet TheNux. Setiap detail akan diteliti, diuji, dan dikembangkan dengan cermat untuk dimasukkan ke dalam dompet untuk memastikan tidak ada celah yang bisa memanipulasi privasi pengguna.";
	$translations['M01373']['Japanese'] = "TheNuxウォレットの安全性に関しては妥協しません。細部に至るまで細心の注意を払って調査、テスト、開発され、ウォレットに組み込まれます。これにより、ユーザーのプライバシーを操作できる抜け穴がないことが保証されます。";
	$translations['M01373']['Korean'] = "저희는 TheNux  지갑에서는 안전을 위해서 최선을 다합니다. 자그만한 디테일에도 신경을 쓰고 실험을 해서 사용자의 정보가 흘러 나올수 없도록 만들고 있습니다.";
	$translations['M01373']['Spanish'] = "No escatimamos cuando se trata de la seguridad de la billetera TheNux. Todos y cada uno de los pequeños detalles se investigan, prueban y desarrollan meticulosamente para que se incluyan en la billetera para garantizar que nada pueda manipular la privacidad de los usuarios.";
	$translations['M01373']['Portuguese'] = "Nós não nos comprometemos quando se trata da segurança da carteira TheNux. Cada detalhezinho é meticulosamente pesquisado, testado e desenvolvido para ser incluído na carteira para assegurar que não há absolutamente nenhuma brecha que poderia manipular a privacidade dos usuários.";
	$translations['M01373']['Thai'] = "เราไม่มีทางบกพร่องหากพูดถึงความปลอดภัยของ TheNux Wallet ทุกรายละเอียดได้รับการค้นคว้าวิจัยมาเป็นอย่างดี ได้รับการทดสอบ และพัฒนาเพื่อที่จะเป็นส่วหนึ่งของ Wallet เพื่อให้แน่ใจว่าไม่มีข้อบกหร่อง หรือช่องโหว่ใด ๆ ให้กับความเป็นส่วนตัวของผูใช้งาน";
	$translations['M01373']['Filipino'] = "Hindi kami nakikipagkompromiso pagdating sa kaligtasan ng wallet na TheNux. Kada isa at bawat maliit na detalye ay lubusang sinaliksik, sinubok at binuo upang maisama sa wallet upang matiyak na walang anumang mga loopholes na maaaring manipulahin ang privacy ng mga gumagamit.";

