	$translations['M01375']['english'] = "As complex and technical cryptocurrency is, it is fundamentally created to make life easier for users. We take it upon us to handle the behind-the-scene complexities while you enjoy the easy-to-use and easy-to-understand benefits of the wallet.";
	$translations['M01375']['chineseSimplified'] = "由于加密货币是它从复杂的技术上创建。为了使更方便用户使用，我们使劲办法研究如何让用户能更容易上手，使您更容易的明白如何使用钱包及明白背后的道理。";
	$translations['M01375']['chineseTraditional'] = "由於加密貨幣是它從復雜的技術上創建。為了使更方便用戶使用，我們使勁辦法研究如何讓用戶能更容易上手，使您更容易的明白如何使用錢包及明白背後的道理。";
	$translations['M01375']['Malay'] = "Sesukar manapun atau teknikal cryptocurrency, ianya pada dasarnya dicipta untuk menjadikan kehidupan lebih mudah bagi pengguna. Kami membawanya keatas kami untuk mengendalikan kerumitan di belakang tempat kejadian semasa anda menikmati faedah dompet yang mudah digunakan dan difahami.";
	$translations['M01375']['Indonesia'] = "Sesulit manupun dan teknis cryptocurrency, ia itu secara fundamental diciptakan untuk membuat hidup lebih mudah bagi pengguna. Kami mengatasinya dan menangani kompleksitas di balik layar sambil anda dapat menikmati manfaat dompet yang mudah digunakan dan dipahami.";
	$translations['M01375']['Japanese'] = "複雑で技術的な仮想通貨は、基本的にユーザーの生活を楽にするために作成されています。ウォレットの使いやすく理解しやすい利点を享受しながら、舞台裏の複雑さを処理することをお約束します。";
	$translations['M01375']['Korean'] = "복잡하고 기계적인 크립토커린시를 쉽게 하기위해서 입니다. 아무것도 절대로 못들어가게 보안을 철저하게 합니다";
	$translations['M01375']['Spanish'] = "Tan compleja y técnica como es la criptomoneda, se crea fundamentalmente para facilitar la vida de los usuarios. Nos encargamos de manejar las complejidades detrás de escena mientras usted disfruta de los beneficios fáciles de usar y fáciles de entender de la billetera.";
	$translations['M01375']['Portuguese'] = "Por mais complexa é técnica que a criptomoeda seja, ela foi criada fundamentalmente para tornar a vida mais fácil para os usuários. Nós assumimos a responsabilidade de lidar com as complexidade nos bastidores enquanto você desfruta dos benefícios fáceis de usar e de entender da carteira.";
	$translations['M01375']['Thai'] = "ตามความซับซ้อน และเทคนิคของสกุลเงินคริปโต มันถูกสร้างขึ้นมาบนพื้นฐานที่ว่าต้องการทำให้ชีวิตของผู้ใช้งานง่ายขึ้น เราคำนึงถึงข้อนี้ตลอดเวลาเพื่อรับมือกับความซับซ้อนที่อยู่เบื้องหลังในขณะที่คุณสามารถใช้งาน และเข้าใจถึงประโยชน์ของ Wallet ได้อย่างง่ายดาย";
	$translations['M01375']['Filipino'] = "Gaano man kakumplikado at teknikal ang cryptocurrency, ito ay pangunahing nilikha upang gawing mas madali ang buhay para sa mga gumagamit. Kami ang himahawak ng mga kumplikadong bagay sa likod nito habang nasiyahan ka sa mga madaling gamitin at madaling unawaing mga benepisyo ng wallet.";

