	$translations['M01397']['english'] = "Coins made by us are acceptable during major exchange around the world. The coins that we’ve created for clients are traded leading cryptocurrency exchange platforms. We adhere to ERC20 based on the Token’s requirement.";
	$translations['M01397']['chineseSimplified'] = "我们制造的币在世界各地的主要交易中都是可以接受的。 我们为客户创建的币是交易领先的加密货币交易平台。 我们制造的每一种币都坚持根据ERC20的要求。";
	$translations['M01397']['chineseTraditional'] = "我們製造的幣在世界各地的主要交易中都是可以接受的。我們為客戶創建的幣是交易領先的加密貨幣交易平台。我們製造的每一種幣都堅持根據ERC20的要求。";
	$translations['M01397']['Malay'] = "Duit syiling yang kami ciptakan boleh diterima semasa pertukaran utama di seluruh dunia. Duit Syiling yang kami ciptakan untuk pelanggan didagangkan platform pertukaran cryptocurrency terkemuka. Kami mematuhi ERC20 berdasarkan keperluan Token.";
	$translations['M01397']['Indonesia'] = "Koin yang kami ciptakan dapat diterima semasa pertukaran besar di seluruh dunia. Koin yang kami ciptakan untuk klien diperdagangkan dengan platform pertukaran cryptocurrency terkemuka. Kami mematuhi ERC20 berdasarkan persyaratan Token.";
	$translations['M01397']['Japanese'] = "我々が作ったコインは、世界中の主要な取引所で受け入れられます。 クライアント向けに作成したコインは、主要な仮想通貨交換プラットフォームで取引されています。 トークンの要件に基づいて、ERC20に準拠します。";
	$translations['M01397']['Korean'] = "코인을 세계적이게 교환할 수 있게 만들어 졌습니다. 저희가 손님을 위해서 만든 코인은 세계적으로 교환되고 있습니다.";
	$translations['M01397']['Spanish'] = "Las monedas fabricadas por nosotros son aceptables durante las principales operaciones en todo el mundo. Las monedas que hemos creado para los clientes son plataformas de operación de criptomonedas líderes en el comercio. Nos adherimos a ERC20 según el requisito del token.";
	$translations['M01397']['Portuguese'] = "As moedas feitas por nós são aceitáveis dentro dos grandes câmbios ao redor do mundo. As moedas que nós criamos para os clientes são negociadas nas principais plataformas de câmbio de criptomoedas. Nós aderimos ao ERC20 com base nos requisitos de Token.";
	$translations['M01397']['Thai'] = "คอยน์ที่ถูกสร้างขึ้นมาดดยเราได้รับการยอมรับจากการแลกเปลี่ยนทั่วโลก คอยน์ที่เราสร้างขึ้นมาสำหรับลูกค้าถูกเทรดที่แพลตฟอร์มที่เป็นผู้นำในด้านนี้ เรายึดตามมาตรฐาน ERC20 ตามข้อกำหนดของโทเคน";
	$translations['M01397']['Filipino'] = "Ang mga barya na ginawa sa amin ay tinatanggap sa panahon ng pangunahing pagpapalitan sa buong mundo. Ang mga barya na nilikha namin para sa mga kliyente ay naikalakal sa nangungunang mga platform ng palitan ng  cryptocurrency. Sumunod kami sa ERC20 batay sa kinakailangan ng Token.";

