	$translations['M01399']['english'] = "You are advised to choose either “Security Tokens” or “Utility Tokens”. However,Utility Tokens (for ICO) will pass the “Howey Test” without difficulty. Our cryptocurrency creator defines and helps you to categorize that your coin is NOT a SECURITY. Kindly remember that, this is 100% required for global exchanges to accept your Utility cryptocurrency coin.";
	$translations['M01399']['chineseSimplified'] = "建议您选择“Security Token”或“Utility Token”。但是 Utility Tokens（用于ICO）会更容易通过“Howey Test”。 我们的加密货币创建者将定义并对您的币分类为不保障，这是为了让全球交易所接受您的公用加密货币。";
	$translations['M01399']['chineseTraditional'] = "建議您選擇“Security Token”或“Utility Token”。但是Utility Tokens（用於ICO）會更容易通過“Howey Test”。我們的加密貨幣創建者將定義並對您的幣分類為不保障，這是為了讓全球交易所接受您的公用加密貨幣。";
	$translations['M01399']['Malay'] = "Anda dinasihatkan untuk memilih sama ada \"Token Keselamatan\" atau \"Token Utiliti\". Walau bagaimanapun, Utiliti Token (untuk ICO) akan lulus \"Ujian Howey\" tanpa kesukaran. Pencipta cryptocurrency kami mendefinisikan dan membantu anda mengkategorikan bahawa duit syiling anda BUKANLAH SEKURITI. Ingatlah, ini adalah 100% diperlukan untuk pertukaran global untuk menerima duit syiling Cryptocurrency Utiliti anda.";
	$translations['M01399']['Indonesia'] = "Anda disarankan untuk memilih “Token Keamanan” atau “Token Utilitas”. Namun, Token Utilitas (untuk ICO) akan lulus \"Tes Howey\" tanpa kesulitan. Pembuat cryptocurrency kami mendefinisikan dan membantu Anda mengategorikan bahwa koin Anda BUKAN SEKURITI. Harap diingat bahwa, ini adalah 100% diperlukan untuk pertukaran global untuk menerima koin cryptocurrency Utility anda.";
	$translations['M01399']['Japanese'] = "「セキュリティトークン」または「ユーティリティトークン」を選択することをお勧めします。 ただし、ユーティリティトークン（ICO用）は「Howeyテスト」に難なく合格します。 我々の仮想通貨作成者は、コインがセキュリティではないことを定義し、分類するのに役立ちます。 これは、グローバルな取引所がユーティリティ仮想通貨を受け入れるために100％必要であることを覚えておいてください。";
	$translations['M01399']['Korean'] = "안전 코인 또는 유틸리티 코인,등을 선택하는 것을 추천합니다. 하지만, 유틸리티 코인은 (ICO을 위한) 하우이 테스트를 쉽게 봅니다. 저희 크립토커런시 코인 크리에터들은 당신이 코인을 만드는 것을 도와드립니다. 100% 기역하세요, 이 코인은 세계적으로 교환이 가능한 코인입니다.";
	$translations['M01399']['Spanish'] = "Se le recomienda elegir \"Tokens de seguridad\" o \"Tokens de utilidad\". Sin embargo, los tokens de utilidad (para ICO) pasarán la \"Prueba Howey\" sin dificultad. Nuestro creador de criptomonedas define y le ayuda a categorizar que su moneda NO es una FIANZA. Recuerde que esto es 100% necesario para que los operacións globales acepten su criptomoneda utilitaria .";
	$translations['M01399']['Portuguese'] = "Você é aconselhado a escolher ou os “Tokens de Segurança” ou os “Tokens de Utilidade”. No entanto, os Tokens de Utilidade (para ICO) irão passar pelo “Teste Howey” sem dificuldade. O nosso criador de criptomoedas define e ajuda você a categorizar que a sua moeda NÃO é de SEGURANÇA. Lembre-se por gentileza que isto é 100% exigido para que os câmbios globais aceitem a sua criptomoeda de Utilidade.";
	$translations['M01399']['Thai'] = "แนะนำให้คุณเลือก \"Security Tokens\" หรือ \"Utility Tokens\" อย่างไรก็ตามโทเค็นยูทิลิตี้ (สำหรับ ICO) จะผ่าน \"Howey Test\" ได้ไม่ยากนัก นักสร้างสกุลเงินคริปโตของเราได้ช่วยกำหนด และช่วยคุณจัดหมวดหมู่ให้กับคอยน์ของคุณเพื่อไม่ให้คอยน์ของคุณเป็นแบบปลอดภัย โปรรดจำไว้ว่าในการเทรดทั่วโลกจำเป็นต้องการ 100% ยูทิลิตี้คอยน์ในการเทรด";
	$translations['M01399']['Filipino'] = "Pinapayuhan kang pumili ng alinman sa \"Mga Token ng Seguridad\" o \"Mga Token ng Kagamitan\". Gayunpaman, ang mga Token ng Kagamitan (para sa ICO) ay papasa ng \"Howey Test\" nang walang kahirap-hirap. Ang aming tagalikha ng cryptocurrency ay tumutukoy at tumutulong sa iyong maiuri na ang iyong barya ay HINDI isang SEGURIDAD. Pakitandaan na, 100% na kinakailangan para sa pandaigdigang pagpapalitan na tanggapin ang iyong Utility cryptocurrency na barya.";

