	$translations['M01401']['english'] = "TheNux has always strived its best to stay connected with the latest news and updates around the crypto industry. Every cryptocurrency coin or token that is created are required to undergo security tests and procedures that allows us to distinguish loopholes that might exist along the process.";
	$translations['M01401']['chineseSimplified'] = "TheNux一直致力于与加密行业的最新新闻和更新保持关注。创建的每个加密货币都需要经过安全测试和程序，以便我们区分流程中可能存在的漏洞。";
	$translations['M01401']['chineseTraditional'] = "TheNux一直致力於與加密行業的最新新聞和更新保持關注。創建的每個加密貨幣都需要經過安全測試和程序，以便我們區分流程中可能存在的漏洞。";
	$translations['M01401']['Malay'] = "TheNux sentiasa berusaha untuk terus terhubung dengan berita dan perkembangan terkini mengenai industri crypto. Setiap duit syiling cryptocurrency atau token yang dibuat dikehendaki menjalani ujian dan prosedur keselamatan yang membolehkan kita membezakan kelemahan yang mungkin wujud sepanjang proses tersebut.";
	$translations['M01401']['Indonesia'] = "TheNux selalu berusaha yang terbaik untuk tetap terhubung dengan berita terbaru dan pembaruan di sekitar industri crypto. Setiap koin atau token cryptocurrency yang dibuat diharuskan untuk menjalani tes keamanan dan prosedur yang memungkinkan kita untuk membedakan celah yang mungkin ada di sepanjang proses.";
	$translations['M01401']['Japanese'] = "TheNuxは、暗号業界に関する最新のニュースや最新情報を常に入手できるよう、常に最善を尽くしています。 作成されるすべての仮想通貨のコインまたはトークンは、プロセスに沿って存在する可能性のある抜け穴を区別できるセキュリティテストと手順を受ける必要があります。";
	$translations['M01401']['Korean'] = "TheNux는 최고가 되기 위해서 가장 최근의 크립토커런시를 이용하고. 사기,등을 방지하기 위해서 보안을 최상급으로 합니다.";
	$translations['M01401']['Spanish'] = "TheNux siempre se ha esforzado por mantenerse conectado con las últimas noticias y actualizaciones sobre la industria de la criptografía. Todas las monedas o tokens de criptomonedas que se crean deben someterse a pruebas de seguridad y procedimientos que nos permitan distinguir las lagunas que puedan existir a lo largo del proceso.";
	$translations['M01401']['Portuguese'] = "O TheNux sempre se esforçou ao máximo para ficar conectado com as últimas notícias e atualizações na criptoindústria. Toda moeda ou token de criptomoeda que é criada tem a obrigação de passar por testes de segurança e procedimentos que nos permitem distinguir brechas que possam existir ao longo do processo.";
	$translations['M01401']['Thai'] = "TheNux กระตือรือร้นเสมอที่จะทำให้ดีที่สุดในการเชื่อมต่อกับข่าว และอัปเดตล่าสุดเกี่ยวกับอุตสาหกรรมคริปโต ทุกคอยน์ของคริปโต หรือโทเค็นที่ถูกสร้างจำเป็นต้องผ่านการทดสอบความปลอดภัย และกระบวนการที่ช่วยทำให้เราสามารถพบช่องโหว่ที่อาจจะเกิดขึ้นระหว่างดำเนินการได้";
	$translations['M01401']['Filipino'] = "Ang TheNux ay palaging nagsusumikap upang manatiling konektado sa pinakabagong mga balita at mga update sa industriya ng crypto. Ang bawat barya ng cryptocurrency o token na nilikha ay kinakailangan na sumailalim sa mga pagsubok at pamamaraan ng seguridad na nagbibigay-daan sa amin upang malaman ang mga loopholes na maaaring umiral sa proseso.";

