	$translations['M01403']['english'] = "Expertise on STO and ICO various from Security Token, Asset Based Token, Altcoin and many more. Our cryptocurrency creator has fulfilled all the compliance information which is automatically generated and linked to smart contract. The A.I. systems are competed enough to make your cryptocurrency achieve its motive.";
	$translations['M01403']['chineseSimplified'] = "STO和ICO的专业知识，包括 Security Token, Asset Based Token, Altcoin等等。 我们的加密货币创建者已经完成了自动生成并链接到智能合约的所有合规信息。 A.I. 系统竞争足以使您的加密货币实现其动机。";
	$translations['M01403']['chineseTraditional'] = "STO和ICO的專業知識，包括 Security Token, Asset Based Token, Altcoin等等。我們的加密貨幣創建者已經完成了自動生成並鏈接到智能合約的所有合規信息。 A.I. 系統競爭足以使您的加密貨幣實現其動機。";
	$translations['M01403']['Malay'] = "Keistimewaan mengenai pelbagai STO dan ICO dari Token Keselamatan, Token Berasaskan Aset, Altcoin dan banyak lagi. Pencipta cryptocurrency kami telah memenuhi semua maklumat pematuhan yang dihasilkan secara automatik dan dihubungkan dengan kontrak pintar. Sistem A.I. yang bersaing cukup untuk menjadikan cryptocurrency anda mencapai motifnya.";
	$translations['M01403']['Indonesia'] = "Keahlian tentang STO dan ICO beragam mulai dari Token Keamanan, Token Berbasis Aset, Altcoin, dan banyak lagi. Pembuat cryptocurrency kami telah memenuhi semua informasi kepatuhan yang secara otomatis dihasilkan dan ditautkan ke kontrak pintar. Sistem A.I. YANG cukup bersaing untuk membuat cryptocurrency anda mencapai motifnya.";
	$translations['M01403']['Japanese'] = "セキュリティトークン、アセットベーストークン、Altcoinなど、さまざまなSTOおよびICOの専門知識。 仮想通貨の作成者は、自動的に生成されてスマートコントラクトにリンクされるすべてのコンプライアンス情報を満たしました。 A.I. システムは、仮想通貨がその動機を達成するのに十分な競争力を持っています。";
	$translations['M01403']['Korean'] = "STO와 ICO등 전문가가 있습니다. 안전 코인에서 도구 코인 까지 많이 있습니다. 저희 크립토커런시 코인 크리에이터들은 정보를 가지고 자동적으로 만들고 있습니다. 저희 A.I. 시스템은 당신의 코인이 더욱 생동감 있게 만들어 드립니다.";
	$translations['M01403']['Spanish'] = "Experiencia en STO e ICO, desde token de seguridad, token basado en activos, Altcoin y muchos más. Nuestro creador de criptomonedas ha cumplido con toda la información de cumplimiento que se genera automáticamente y se vincula al contrato inteligente. Los sistemas de IA son lo suficientemente competentes como para que su criptomoneda logre su objetivo.";
	$translations['M01403']['Portuguese'] = "Expertise em STO e ICO, variando em Token de Segurança, Token Baseado em Ativos, Altcoin e muitos mais. O nosso criador de criptomoedas cumpriu com todas as conformidades, informação que é automaticamente gerada e ligada ao contrato inteligente. Os sistemas de I.A. são completos o bastante para fazer a sua criptomoeda alcançar suas motivações.";
	$translations['M01403']['Thai'] = "ผู้เชี่ยวชาญของ STO  และ ICO จากหลาย Security Token โทเค็นที่เกียวข้องกับสินทรัพย์ คอยน์ทางเลือก และอื่น ๆ อีกมาย ผู้สร้างสกุลเงินคริปโตของเราได้เติมเต็มที่ข้อมูลซึ่งเป็นกระบวนการอัตโนมัติในการสร้าง และเชื่อมต่อกับสัญญาอัจฉริยะ ระบบ AI เก่งมากพอที่จะทำให้คุณสกุลเงินคริปโตของคุณทำตามเป้าได้";
	$translations['M01403']['Filipino'] = "Ang kadalubhasaan sa STO at ICO ay nag-iiba mula sa Security Token, Asset Based Token, Altcoin at marami pa. Natupad ng aming tagalikha ng cryptocurrency ang lahat ng impormasyon sa pagsunod na awtomatikong nabuo at naka-link sa kontrata ng smart. Ang mga sistema ng A.I ay sapat na nakikipagkumpitensya upang makamit ang motibo ng iyong cryptocurrency.";

