	$translations['M01405']['english'] = "TheNux is the safest platform for you to create your own coin. You can store your cryptocurrency by creating wallet from outside or in TheNux’s wallet without any complication.";
	$translations['M01405']['chineseSimplified'] = "TheNux是一个最安全的平台让您能创建自己的币。 您可以通过从外部或在TheNux的钱包中创建钱包来存储您的加密货币，而且不会出现任何复杂情况。";
	$translations['M01405']['chineseTraditional'] = "TheNux是一個最安全的平台讓您能創建自己的幣。您可以通過從外部或在TheNux的錢包中創建錢包來存儲您的加密貨幣，而且不會出現任何復雜情況。";
	$translations['M01405']['Malay'] = "TheNux adalah platform paling selamat untuk anda mencipta duit syiling anda sendiri. Anda boleh menyimpan cryptocurrency anda dengan membuat dompet dari luar atau di dompet TheNux tanpa sebarang komplikasi.";
	$translations['M01405']['Indonesia'] = "TheNux adalah platform teraman bagi anda untuk mencipta koin anda sendiri. Anda dapat menyimpan mata uang digital anda dengan membuat dompet dari luar atau di dompet TheNux tanpa kesulitan.";
	$translations['M01405']['Japanese'] = "TheNuxは、独自のコインを作成するための最も安全なプラットフォームです。仮想通貨を保存するには、外部から、またはTheNuxのウォレットにウォレットを作成します。複雑なことはありません。";
	$translations['M01405']['Korean'] = "TheNux는 코인을 소유하기 가장 안전한 플랫폼입니다. 당신은 크립토커런시를 TheNux 지갑 또는 다른 지갑을 사용해 저장할수 있습니다";
	$translations['M01405']['Spanish'] = "TheNux es la plataforma más segura para que puedas crear tu propia moneda. Puede almacenar su criptomoneda creando una billetera desde afuera o en la billetera de TheNux sin ninguna complicación.";
	$translations['M01405']['Portuguese'] = "O TheNux é a plataforma mais segura para você criar a sua própria moeda. Você pode armazenar a sua criptomoeda criando uma carteira de fora ou dentro da carteira TheNux sem qualquer complicação.";
	$translations['M01405']['Thai'] = "TheNux เป็นแพลตฟอร์มที่ปลอดภัยมากที่สุดในการสร้างคอยน์ของตัวคุณเอง คุณสามารถเก็บสกุลเงินคริปโตได้โดยการสร้าง Wallet จากภายนอก หรือใน TheNux Wallet เองโดยที่ไม่มีปัญหาใด ๆ";
	$translations['M01405']['Filipino'] = "Ang TheNux ay ang pinakaligtas na platform para sa iyo upang lumikha ng iyong sariling barya. Maaari mong maiimbak ang iyong cryptocurrency sa pamamagitan ng paglikha ng wallet mula sa labas o sa loob wallet ng TheNux nang walang anumang komplikasyon.";

	$translations['M01406']['english'] = "Besides, TheNux wallet also allows you to send your preferred amount of transaction easily when the recipient downloads our app.";
	$translations['M01406']['chineseSimplified'] = "此外，TheNux钱包还允许您在收件人下载我们的应用程序时轻松发送您的首选交易量。";
	$translations['M01406']['chineseTraditional'] = "此外，TheNux錢包還允許您在收件人下載我們的應用程序時輕鬆發送您的首選交易量。";
	$translations['M01406']['Malay'] = "Selain itu, dompet TheNux juga membolehkan anda menghantar jumlah urus niaga pilihan anda dengan mudah apabila penerima memuat turun aplikasi kami.";
	$translations['M01406']['Indonesia'] = "Selain itu, TheNux wallet juga memungkinkan anda untuk mengirim jumlah transaksi pilihan anda dengan mudah ketika penerima mengunduh aplikasi kami.";
	$translations['M01406']['Japanese'] = "また、TheNuxウォレットを使用すると、受信者がアプリをダウンロードしたときに、希望する金額の取引を簡単に送信できます。";
	$translations['M01406']['Korean'] = "또다른 것은, TheNux는 원하는 양을 앱을 사용해 쉽게 보낼수 있습니다";
	$translations['M01406']['Spanish'] = "Además, la billetera TheNux también le permite enviar una transacción en la cantidad de su preferencia fácilmente cuando el destinatario descarga nuestra aplicación.";
	$translations['M01406']['Portuguese'] = "Além disso, a carteira TheNux permite que você envie a sua quantia de preferência na transação facilmente quando o destinatário baixa o nosso app.";
	$translations['M01406']['Thai'] = "นอกเหนือไปจากนี้ TheNux Wallet ยังให้คุณได้ส่งจำนวนเงินที่คุณต้องการในการทำธุรกรรมได้ง่ายด้ายเพียงแค่ผู้รับดาวน์โหลดแอปของเรา";
	$translations['M01406']['Filipino'] = "Bukod dito, pinapayagan ka rin ng Wallet ng TheNux na maipadala nang madali ang iyong ginustong halaga ng transaksyon kapag na-download ng tatanggap ang aming app.";

	$translations['M01407']['english'] = "TheNux wallet is ready to be used instantly and unlike other platform where you have to go through several process before performing transaction, whereas by using TheNux wallet it can be done at that point of time.";
	$translations['M01407']['chineseSimplified'] = "TheNux钱包已准备好立即使用，与其他平台不同。您不必在执行交易之前经历多个流程，而使用TheNux钱包则可以直接交易。";
	$translations['M01407']['chineseTraditional'] = "TheNux錢包已準備好立即使用，與其他平台不同。您不必在執行交易之前經歷多個流程，而使用TheNux錢包則可以直接交易。";
	$translations['M01407']['Malay'] = "Dompet TheNux tersedia untuk digunakan dengan serta-merta dan tidak seperti platform lain di mana anda perlu melalui beberapa proses sebelum melakukan urus niaga, sedangkan dengan menggunakan TheNux wallet dapat dilakukan pada saat itu.";
	$translations['M01407']['Indonesia'] = "Dompet TheNux siap digunakan secara instan dan tidak seperti platform lain di mana anda harus melalui beberapa proses sebelum melakukan transaksi, sedangkan dengan menggunakan TheNux wallet dapat dilakukan pada titik waktu tersebut.";
	$translations['M01407']['Japanese'] = "TheNuxウォレットはすぐに使用でき、トランザクションを実行する前にいくつかのプロセスを実行する必要がある他のプラットフォームとは異なり、TheNuxウォレットを使用するとその時点で実行できます。";
	$translations['M01407']['Korean'] = "다른 프로그램과는 달리 TheNux는 그때 바로 사용 가능합니다";
	$translations['M01407']['Spanish'] = "La billetera TheNux está lista para usarse instantáneamente y, a diferencia de otras plataformas, en la cuales debe pasar por varios procesos antes de realizar la transacción, al usar la billetera TheNux se puede hacer en ese mismo momento.";
	$translations['M01407']['Portuguese'] = "A carteira TheNux está pronta para ser usada instantaneamente, diferente de outras plataformas, onde você tem que passar por vários processos antes de realizar a transação, ao passo que com a carteira TheNux, isso pode ser feito naquele mesmo instante.";
	$translations['M01407']['Thai'] = "TheNux Wallet พร้อมสำหรับการใช้งานอย่างรวดเร็ว ไม่เหมือนกับแพลตฟอร์มอื่น ๆ ที่คุณจำเป็นต้องผ่านหลายขั้นตอนกระบวนการก่อนที่จะเริ่มต้นทำธุรกรรมได้ ในขณะที่การใช้ TheNux Wallet ใช้เวลาไม่นาน";
	$translations['M01407']['Filipino'] = "Ang Wallet ng TheNux ay handa nang magamit agad at hindi katulad ng iba pang platform kung saan kailangan mong dumaan sa maraming proseso bago magsagawa ng transaksyon, samantalang sa pamamagitan ng paggamit ng wallet ng TheNux maaari itong gawin sa oras ding iyon.";

	$translations['M01408']['english'] = "Besides wallet, our exchange platform also enables you to trade in your coin instantly.";
	$translations['M01408']['chineseSimplified'] = "除了钱包，我们的交易平台还可以让您立即交易您的币。";
	$translations['M01408']['chineseTraditional'] = "除了錢包，我們的交易平台還可以讓您立即交易您的幣。";
	$translations['M01408']['Malay'] = "Selain dompet, platform pertukaran kami juga membolehkan anda berniaga dalam duit syiling anda dengan serta-merta.";
	$translations['M01408']['Indonesia'] = "Selain dompet, platform pertukaran kami juga memungkinkan anda untuk berdagang koin anda secara instan.";
	$translations['M01408']['Japanese'] = "ウォレットの他に、当社の交換プラットフォームでは、コインを即座に取引することもできます。";
	$translations['M01408']['Korean'] = "지갑외 저희의 교환 플랫폼은 코인을 바로 교환 할수 있게 합니다";
	$translations['M01408']['Spanish'] = "Además de la billetera, nuestra plataforma de operación también le permite intercambiar su moneda al instante.";
	$translations['M01408']['Portuguese'] = "Além da carteira, a nossa plataforma de câmbio também habilita você a negociar sua moeda instantaneamente.";
	$translations['M01408']['Thai'] = "นอกเหนือไปจาก Wallet แล้ว แพลตฟอร์มการแลกเปลี่ยนของเรายังช่วยให้คุณสามารถเทรดคอยน์ของคุณได้ทันทีอีกด้วย";
	$translations['M01408']['Filipino'] = "Bukod sa wallet, binibigyang-daan ka rin ng aming platform ng pagpapalitan na kaagad na makipagkalakal sa iyong barya.";

	$translations['M01409']['english'] = "TheNux has always strived our best to put user’s satisfaction first in providing you a pleasant experience while using our app.";
	$translations['M01409']['chineseSimplified'] = "TheNux一直致力为用户提供愉快的体验。";
	$translations['M01409']['chineseTraditional'] = "TheNux一直致力為用戶提供愉快的體驗。";
	$translations['M01409']['Malay'] = "TheNux sentiasa berusaha sebaik mungkin untuk meletakkan kepuasan pengguna terlebih dahulu dalam memberikan pengalaman yang menyenangkan semasa menggunakan aplikasi kami.";
	$translations['M01409']['Indonesia'] = "TheNux selalu berusaha yang terbaik untuk mengutamakan kepuasan pengguna dalam memberikan anda pengalaman yang menyenangkan saat menggunakan aplikasi kami.";
	$translations['M01409']['Japanese'] = "TheNuxは、アプリの使用中に快適なエクスペリエンスを提供する上で、ユーザーの満足を最優先するよう常に努力してきました。";
	$translations['M01409']['Korean'] = "저희는 언제나 사용자가 만족을 할수 있도록 노력합니다";
	$translations['M01409']['Spanish'] = "TheNux siempre se ha esforzado por poner la satisfacción del usuario en primer lugar para brindarle una experiencia agradable al usar nuestra aplicación.";
	$translations['M01409']['Portuguese'] = "O TheNux sempre se esforçou ao máximo para colocar a satisfação do usuário em primeiro lugar, oferecendo uma experiência agradável ao usar o nosso app.";
	$translations['M01409']['Thai'] = "TheNux พยายามอย่างเต็มที่เพื่อให้ผู้ใช้งานพึงพอใจ และมีประสบการณ์ที่ดีในการใช้แอปของพวกเรา";
	$translations['M01409']['Filipino'] = "Ang TheNux ay palaging nagsusumikap sa aming makakaya na unahin ang kasiyahan ng gumagamit sa pagbibigay sa iyo ng isang kaaya-ayang karanasan habang ginagamit ang aming app.";

