	$translations['M01430']['english'] = "TheNux reserves the right to change the terms of the Master Dealer program at any time due to changing market conditions, risk of fraud, or any other factors we deem relevant.";
	$translations['M01430']['chineseSimplified'] = "由于市场条件的变化，欺诈的风险，或者我们认为有关的任何其他因素的权利，所以TheNux保留随时更改主经销商计划的条款。";
	$translations['M01430']['chineseTraditional'] = "由於市場條件的變化，欺詐的風險，或者我們認為有關的任何其他因素的權利，所以TheNux保留隨時更改主經銷商計劃的條款。";
	$translations['M01430']['Malay'] = "TheNux berhak untuk mengubah syarat-syarat program pedagang utama pada bila-bila masa disebabkan perubahan keadaan pasaran, risiko penipuan, atau faktor lain yang kami anggap relevan.";
	$translations['M01430']['Indonesia'] = "TheNux berhak untuk mengubah ketentuan program pedagang utama kapan saja karena kondisi pasar yang berubah, risiko penipuan, atau faktor lain yang kami anggap relevan.";
	$translations['M01430']['Japanese'] = "TheNuxは、市場の状況の変化、詐欺のリスク、または関連すると思われるその他の要因により、マスターディーラープログラムの条件をいつでも変更する権利を留保します。";
	$translations['M01430']['Korean'] = "TheNux는 마켓 컨디션, 사기, 또는 다른이유 때문에 마스터 딜러 이용약관을 변경할수 있습니다";
	$translations['M01430']['Spanish'] = "TheNux se reserva el derecho de cambiar los términos del programa Distribuidor Maestro en cualquier momento debido a las condiciones cambiantes del mercado, el riesgo de fraude o cualquier otro factor que consideremos relevante.";
	$translations['M01430']['Portuguese'] = "O TheNux se reserva o direito de alterar os termos do programa Master Dealer a qualquer momento devido a alterações nas condições do mercado, risco de fraude, ou quaisquer outros fatores que julguemos relevantes.";
	$translations['M01430']['Thai'] = "TheNux มีสิทธิในการเปลี่ยนแปลงข้อกำหนดของโปรแกรมตัวแทนจำหน่ายหลักเมื่อใดก็ได้ตามสภาพการเปลี่ยนแปลงของตลาด ความเสี่ยงในการทุจริต และปัจจัยอื่น ๆ ที่เราเห็นว่าเกี่ยวข้อง";
	$translations['M01430']['Filipino'] = "Ang TheNux ay may karapatan na baguhin ang mga term ng programa ng Master Dealer sa anumang oras dahil sa pagbabago ng mga kondisyon ng merkado, panganib ng pandaraya, o anumang iba pang mga kadahilanan na ipinapalagay naming nauugnay.";

